INSERT INTO `subcategoria_2` (`clave`, `clave_categoria_s2`, `clave_sub1_s2`, `nombre_sub2`, `foto_sub2`, `texto_sub2`, `publica_sub2`, `tiene_stock`, `capacidad`, `idd_fechas`, `precio_sub2`, `idd_empresa_sub2`) VALUES
(12, 1, 1, 'Tk Ríos de Hielo Express', '', '<p style="text-align: justify;"><span style="font-size: small;"><strong>Espectacular navegaci&oacute;n al coraz&oacute;n de los hielos continentales. </strong>Parte desde el Puerto Punta Bandera, ubicado al 47 Km. de la ciudad.Una  vez a bordo navegaremos en un moderno catamar&aacute;n a trav&eacute;s del Brazo  Norte del Lago Argentino  hasta llegar al Canal Upsala, donde nos  encontraremos con una  espectacular Barrera de Hielo. Desde all&iacute;  tendremos una vista panor&aacute;mica  del Glaciar Upsala. Luego navegaremos el  Canal Spegazzini, donde  podremos observar el Glaciar Seco, hasta  llegar al frente del Glaciar  Spegazzini, el m&aacute;s alto del Parque  Nacional. Se regresa a Puerto Punta Bandera navegando nuevamente por el Brazo Norte. El recorrido  puede ser modificado en funci&oacute;n de las condiciones  clim&aacute;ticas y de  seguridad y por decisi&oacute;n del capit&aacute;n de la embarcaci&oacute;n. <strong>&iquest;Que llevar? </strong>Anteojos para sol, crema solar, ropa c&oacute;moda y abrigada, campera impermeable, guantes y calzado c&oacute;modo<strong>.</strong></span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Dificultad: </strong>No tiene, apta para todas las edades </span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"> <strong>No incluye: </strong> </span><br>\r\n<ul style="text-align: justify;">\r\n<li><span style="font-size: small;">Transporte al puerto desde y hacia su alojamiento. </span></li>\r\n<li><span style="font-size: small;">Entrada al Parque Nacional Los Glaciares ni almuerzo. Las entradas al Parque se pagan al ingreso del mismo, solo en efectivo. <a href="http://www.calafate.com/es/es-cal-excursiones/134.html">Ver valores vigentes</a></span></li>\r\n<li><span style="font-size: small;">Se recomienda llevar vianda. </span></li>\r\n</ul>\r\n<p style="text-align: justify;"><span style="font-size: small;"> <strong>Frecuencia:</strong> Todos los dias, no se suspende por lluvias.&nbsp;<strong>Duraci&oacute;n:</strong> Excursi&oacute;n de d&iacute;a entero.<strong>Salida:</strong> 07:00 hs. - <strong>Regreso:</strong> 15:00 hs.&nbsp; <strong>Observaciones: </strong>Para  realizar esta actividad en servicio regular tener en cuenta que el tour  comienza temprano por la ma&ntilde;ana y es necesario estar la noche anterior  en El Calafate.</span><br>', 'si', 'no', 2, 1391634401, '920.00', 1),
(68, 1, 1, 'Glaciares Gourmet EXT', '', '<p style="text-align: justify;"><span style="font-size: small;"><strong>Salida: </strong>07:15 hs.<strong> - Regreso: </strong>18:45 hs.</span><br>\r\n<p style="text-align: justify;"><strong><span style="font-size: small;">U$S 288 ($2.448) Exc. + 30 U$S ($255) Trf. + Entrada PN ($ 215 o 150 seg&uacute;n corresponda)</span></strong><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">07:15 traslado desde los hoteles de El Calafate hacia el Paraje Punta Bandera. Embarque a las 8:30 hs en el Puerto Privado La Soledad (Bah&iacute;a Tranquila, Paraje Punta Bandera). El recorrido se inicia con rumbo noroeste, pasando por Punta Avellaneda y Boca del Diablo- el paso m&aacute;s estrecho del lago, con un ancho de aproximadamente 800 metros -. Luego de dos horas de navegaci&oacute;n, la sucesi&oacute;n de t&eacute;mpanos de los m&aacute;s variados colores y formas nos anuncia la cercan&iacute;a del glaciar Upsala. Nos detenemosfrente a la barrera det&eacute;mpanos que moment&aacute;neamente impide el ingreso al Canal Upsala, y si las condicionesclim&aacute;ticas lo permiten, admiramos el Glaciar Upsala a la distancia.Continuamossurcando el lago Argentino rumbo sur, y tomamos el Canal Spegazzini parallegar al glaciar del mismo nombre. La navegaci&oacute;n permite un acercamiento impactante a este glaciar que cuenta con paredes frontales de entre 80 y 135 metros sobre el nivel dellago. Se sirve el almuerzo disfrutando de este maravilloso paisaje. Hacia la tarde el Crucero Leal llega a Puesto de las Vacas -bah&iacute;a sumamente tranquila dentrodel canal Spegazzini-, donde silencia sus motores para permitir a los pasajeros compartir unainteresante caminata coordinada por nuestro equipo de gu&iacute;as. En este descenso es posibleapreciar magn&iacute;ficos puntos panor&aacute;micos del Glaciar Spegazzini. Posteriormente se emprende el regreso por el Brazo Norte, para estar llegando al puerto&nbsp;Privado La Soledad a las 17:30 hs. .</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Ruta sujeta a modificaciones seg&uacute;n lo crea conveniente el capit&aacute;n, para mayor seguridad delos pasajeros.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">El Programa Incluye:&nbsp;Navegaci&oacute;n por el Lago Argentino, visitando la barrera de t&eacute;mpanos del Canal Upsala(que moment&aacute;neamente impide el acercamiento al Glaciar Upsala), y el impactante Glaciar Spegazzini. Almuerzo gourmet a bordo con bebidas alcoh&oacute;licas y no alcoh&oacute;licas incluidas. Desembarque en Puesto de las Vacas. Infusiones y bebidas no alcoh&oacute;licas durante todo el recorrido. Actividades a bordo acompa&ntilde;adas por gu&iacute;a biling&uuml;e (ingl&eacute;s-espa&ntilde;ol).</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Ficha T&eacute;cnica&nbsp;Eslora: 20 metros.Manga: 5.80 metros. Calado: 1.50 metros.Material del casco y superestructura: Acero naval.Motorizaci&oacute;n: 2 x 460 HP Detroit diesel.Velocidad de crucero: 13 nudos. Electricidad: 12, 24 y 220 volts (auxiliar diesel lombardini 22 kva) Sal&oacute;n principal: 4 mesas para 6 personas y una mesa para 4 personas. Cubierta en proa, popa y cubierta principal en nivel superior. Capacidad m&aacute;xima: 28 pasajeros.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Menu Desgustacion Nuestro almuerzo Gourmet es especialmente preparado por nuestro chef a bordo.</span> <span>&nbsp;</span><br>', 'si', 'no', 5, 1420313257, '2448.00', 1),
(39, 1, 5, 'Upsala Kayak Experience', '', '<p style="text-align: justify;"><span style="font-size: small;">Excursi&oacute;n Kayak Experience. Sumar al valor de la excursi&oacute;n la entrada al Parque Nacional.<br /></span><span style="font-size: small;"><strong>Duraci&oacute;n:</strong> 10 horas<br /><strong>Salida: </strong>07:00 hs. <strong>Regreso:</strong> 17:00 hs.&nbsp;<br /><strong>Edad m&iacute;nima:</strong><span>&nbsp;18 a&ntilde;os</span>&nbsp;</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">El&nbsp;<strong>Glaciar Upsala</strong>&nbsp;es uno de los m&aacute;s importantes del&nbsp;<strong>Parque Nacional Los Glaciares</strong>, y el segundo en tama&ntilde;o de&nbsp;<strong>Argentina</strong>. Cuenta con una superficie de aproximadamente 850 km2, y la altura de su frente alcanza hasta los 60 metros sobre el nivel del lago. Su frente principal, anteriormente visitado mediante la&nbsp;<strong>navegaci&oacute;n por el Canal Upsala</strong>, estuvo varios a&ntilde;os sin poder ser observado, debido a la gran cantidad de t&eacute;mpanos que impidieron el acceso a este canal. El&nbsp;<strong>Glaciar Upsala</strong>&nbsp;es famoso mundialmente por la gran cantidad de t&eacute;mpanos&nbsp;que rompe y que quedan a flote. Podr&aacute;s&nbsp;<strong>avistar</strong>&nbsp;los<strong>icebergs</strong>&nbsp;que flotan como gigantes balsas de hielo en las aguas del&nbsp;<strong>Lago Argentino</strong>, y que se agrupan unos con otros.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">El programa&nbsp;<strong>Upsala Kayak Experience</strong>&nbsp;se realiza &iacute;ntegramente en el&nbsp;<strong>canal Upsala</strong>&nbsp;del&nbsp;<strong>Lago Argentino</strong>&nbsp;y permite&nbsp;<strong>navegar en kayaks&nbsp;</strong>de traves&iacute;a dobles con la<strong>&nbsp;</strong>posibilidad<strong>&nbsp;</strong>de<strong>&nbsp;avistar Icebergs gigantes</strong>, siempre siguiendo todos los protocolos de seguridad. Se trata de una excursi&oacute;n con&nbsp;<strong>gu&iacute;as profesionales</strong>&nbsp;y con grupos peque&ntilde;os de pasajeros. La&nbsp;<strong>excursi&oacute;n guiada en kayak en la Patagonia</strong>&nbsp;durante 2 horas aproximadamente, ser&aacute; de paleo lento y adaptado al nivel del grupo y de las condiciones del entorno. Durante el trayecto se podr&aacute; observar la fauna y flora de la zona (c&oacute;ndores, &aacute;guilas, vacas salvajes, &ntilde;ires, lengas) as&iacute; como pasar muy cerca de numerosos acantilados gigantes y grandes monta&ntilde;as.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">La actividad&nbsp;<strong>Upsala Kayak Experience</strong>&nbsp;ha sido dise&ntilde;ada y est&aacute; apoyada por los l&iacute;deres Europeos en&nbsp;<strong>kayak</strong>&nbsp;y&nbsp;<strong>rafting</strong>,&nbsp;<strong>Rocroi</strong>.&nbsp;</span><br>\r\n<p class="edad-minima" style="text-align: justify;">&nbsp;<br>\r\n<p style="text-align: justify;">&nbsp;<br>\r\n<p style="text-align: justify;">&nbsp;<br>', 'si', 'no', 5, 1420212585, '2700.00', 1),
(34, 1, 1, 'Glaciares Gourmet AR', '', '<p style="text-align: justify;">&nbsp; <span style="font-size: small;"><strong>Salida:&nbsp;</strong>07:15 hs.<strong>&nbsp;- Regreso:&nbsp;</strong>18:45 hs.</span> <span style="font-size: small;"><strong>Incluye: Tk de excursi&oacute;n, trf in/out y entrada al PN.</strong></span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">07:15 traslado desde los hoteles de El Calafate hacia el Paraje Punta Bandera. Embarque a las 8:30 hs en el Puerto Privado La Soledad (Bah&iacute;a Tranquila, Paraje Punta Bandera). El recorrido se inicia con rumbo noroeste, pasando por Punta Avellaneda y Boca del Diablo- el paso m&aacute;s estrecho del lago, con un ancho de aproximadamente 800 metros -. Luego de dos horas de navegaci&oacute;n, la sucesi&oacute;n de t&eacute;mpanos de los m&aacute;s variados colores y formas nos anuncia la cercan&iacute;a del glaciar Upsala. Nos detenemosfrente a la barrera det&eacute;mpanos que moment&aacute;neamente impide el ingreso al Canal Upsala, y si las condicionesclim&aacute;ticas lo permiten, admiramos el Glaciar Upsala a la distancia.Continuamossurcando el lago Argentino rumbo sur, y tomamos el Canal Spegazzini parallegar al glaciar del mismo nombre. La navegaci&oacute;n permite un acercamiento impactante a este glaciar que cuenta con paredes frontales de entre 80 y 135 metros sobre el nivel dellago. Se sirve el almuerzo disfrutando de este maravilloso paisaje. Hacia la tarde el Crucero Leal llega a Puesto de las Vacas -bah&iacute;a sumamente tranquila dentrodel canal Spegazzini-, donde silencia sus motores para permitir a los pasajeros compartir unainteresante caminata coordinada por nuestro equipo de gu&iacute;as. En este descenso es posibleapreciar magn&iacute;ficos puntos panor&aacute;micos del Glaciar Spegazzini. Posteriormente se emprende el regreso por el Brazo Norte, para estar llegando al puerto&nbsp;Privado La Soledad a las 17:30 hs. .</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Ruta sujeta a modificaciones seg&uacute;n lo crea conveniente el capit&aacute;n, para mayor seguridad delos pasajeros.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">El Programa Incluye:&nbsp;Navegaci&oacute;n por el Lago Argentino, visitando la barrera de t&eacute;mpanos del Canal Upsala(que moment&aacute;neamente impide el acercamiento al Glaciar Upsala), y el impactante Glaciar Spegazzini. Almuerzo gourmet a bordo con bebidas alcoh&oacute;licas y no alcoh&oacute;licas incluidas. Desembarque en Puesto de las Vacas. Infusiones y bebidas no alcoh&oacute;licas durante todo el recorrido. Actividades a bordo acompa&ntilde;adas por gu&iacute;a biling&uuml;e (ingl&eacute;s-espa&ntilde;ol).</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Ficha T&eacute;cnica&nbsp;Eslora: 20 metros.Manga: 5.80 metros. Calado: 1.50 metros.Material del casco y superestructura: Acero naval.Motorizaci&oacute;n: 2 x 460 HP Detroit diesel.Velocidad de crucero: 13 nudos. Electricidad: 12, 24 y 220 volts (auxiliar diesel lombardini 22 kva) Sal&oacute;n principal: 4 mesas para 6 personas y una mesa para 4 personas. Cubierta en proa, popa y cubierta principal en nivel superior. Capacidad m&aacute;xima: 28 pasajeros.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Menu Desgustacion Nuestro almuerzo Gourmet es especialmente preparado por nuestro chef a bordo.&nbsp;&nbsp;</span><br>\r\n<p style="text-align: justify;">&nbsp;<br>\r\n<p style="text-align: justify;">&nbsp;<br>', 'si', 'no', 5, 1417735766, '2280.00', 1),
(36, 5, 6, 'Lunch Box 1', '', 'Incluye: bebida, sandwich, empanada, ensalada de frutas y alfajor<br>', 'si', 'no', 20, 1418775345, '140.00', 1),
(21, 1, 5, 'Glaciarium', '', 'Es un moderno centro dedicado a la divulgaci&oacute;n del hielo patag&oacute;nico y sus glaciares. Uno de los pocos centros de interpretaci&oacute;n glaciol&oacute;gica en el mundo. Adem&aacute;s brinda un mensaje de concientizaci&oacute;n ambiental. Glaciarium utiliza las nuevas t&eacute;cnicas de exhibici&oacute;n usadas por los museos y centros de interpretaci&oacute;n m&aacute;s modernos. Los contenidos se presentan de manera art&iacute;stica, con interacciones y exhibiciones que incluyen efectos esc&eacute;nicos, lum&iacute;nicos y presentaciones audiovisuales y multimedia y un documental 3D. Dentro de sus instalaciones hay una cafeter&iacute;a, un Ecoshop y un bar de hielo.El Ecoshop ofrece una variada opci&oacute;n de objetos ecosustentables, producidos con material de descarte, reciclados y de bajo impacto ambiental.<br>', 'si', 'si', 20, 1405006779, '185.00', 1),
(17, 2, 4, 'Trf SIB In Aep Fte/Htl Fte', '', 'Aeropuerto - Hotel Nota: Menores de 02 a&ntilde;os sin cargo, no ocupa lugar.<br>', 'si', 'si', 20, 1402930660, '75.00', 1),
(18, 2, 4, 'Trf SIB Out Htl Fte/Aep Fte', '', 'Hotel - AeropuertoNOTA: menores de 0 a 2 &ntilde;oas, sin cargo no ocupan lugar.<br>', 'si', 'si', 20, 1402953345, '75.00', 1),
(19, 1, 5, 'Safari Nautico', '', '<p style="text-align: justify;"><span style="font-size: small; color: #000000;"><strong>Navegaci&oacute;n por el Brazo Rico del Lago Argentino que permite apreciar &nbsp;la majestuosicadad de la Pared Sur del Glaciar Perito Moreno, como as&iacute; tambien tempanos que flotan sobre las aguas del Brazo Rico.</strong></span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><span style="color: #000000;">Esta Excursi&oacute;n tiene una duracion de 1 hora aproximadamente y brinda la posibilida</span>d de observar con una perspectiva totalmente diferente la impresionante Pared Sur del Glaciar Perito Moreno y sus continuos derrumbes sobre las aguas. Una vez frente a la pared, la embarcaci&oacute;n se detendra por unos minutos para poder apreciar mas detalladamente todo el paisaje que rodea al imponente Glaciar. El embarque se realiza en el Puerto Bajo de las Sobras, ubicado 6 km. del sector de pasarelas del Glaciar Perito Moreno, con salidas diarias entre las 10 a.m. y las 15 p.m. <strong>Dificultad:&nbsp;</strong>No tiene, apta para todas las edades.</span><strong style="font-size: small;">Incluye:&nbsp;</strong><span style="font-size: small;">Gu&iacute;a Biling&uuml;e</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"> <strong>No incluye:&nbsp;</strong>Transporte desde y hacia su alojamiento.Entrada al Parque Nacional Los Glaciares, ni almuerzo, ni extras de ningun tipo. Las entradas al Parque se pagan al ingreso del mismo, solo en efectivo. &nbsp;<strong>Frecuencia:</strong>&nbsp;Diaria, no se suspende por lluvias. <strong>Duraci&oacute;n:</strong>&nbsp;una hora de navegaci&oacute;n.&nbsp;</span><br>', 'si', 'no', 40, 1404054767, '200.00', 1),
(45, 1, 5, 'Bosque Petrificado La Leona', '', '<p style="text-align: justify;"><span style="font-size: small;">Traslado. Gu&iacute;a. Trekking. Lunch Box con bebida. Edad minima: 8 a&ntilde;os.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Bosque Petrificado La Leona:</strong></span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Esta es una opci&oacute;n diferente y de d&iacute;a completo en la zona de la estepa patag&oacute;nica, especialmente dise&ntilde;ada para aquellos que disfrutan el contacto con la naturaleza y el deseo de descubrir lugares &uacute;nicos. La excursi&oacute;n que nos regala paisajes fant&aacute;sticos y por momentos como de otro planeta, se desarrolla en una Estancia que se ubica a mitad de camino entre El Calafate y El Chalt&eacute;n en un desv&iacute;o de la m&iacute;tica Ruta 40. Descubra con nosotros el maravilloso mundo petrificado de bosques y dinosaurios que habitaron esta zona hace millones de a&ntilde;os.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Itinerario:</strong></span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Partimos a las 09 de la ma&ntilde;ana desde El Calafate, recorriendo 90 km, por la Ruta Provincial N&ordm; 11 hacia el Este y luego 30 Km hacia el Sur por la m&iacute;tica Ruta Nacional N&ordm; 40. Durante este trayecto bordeamos el gigantesco Lago Argentino y su gigantesco valle, disfrutamos da las infinitas variedades de ocres de la inmensa estepa patag&oacute;nica con un bello fondo de la Cordillera de los Andes y el imponente Cerro Fitz Roy. Realizamos una parada de aproximadamente 15/20 minutos en el Hotel La Leona (sitio hist&oacute;rico). </span> <span style="font-size: small;"> Luego tomamos un camino de ripio por 10 Km hacia el Oeste, siguiendo la margen Sur del lago Viedma, hasta llegar al faldeo del Cerro Los Hornos (Estancia Santa Teresita), donde arribamos al yacimiento paleontol&oacute;gico alrededor de las 12:00&nbsp;hs.</span><br>\r\n<p style="text-align: justify;">&nbsp;<br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Nos asomamos por primera vez a la enorme y profunda depresi&oacute;n del terreno en donde se encuentran los troncos petrificados de una antig&uuml;edad de 70 millones de a&ntilde;os y comenzamos nuestra caminata de exploraci&oacute;n entre los f&oacute;siles. A mitad del recorrido hacemos un alto para almorzar.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">A lo largo de la caminata vemos infinidad de troncos petrificados que yacen en la superficie, algunos de un di&aacute;metro de 1,20 m. testimonio de antiguas &eacute;pocas en donde el clima era muy diferente al actual y permit&iacute;a el soporte de una flora abundante y de grandes dimensiones.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Ocasionalmente quedan al descubierto restos f&oacute;siles de distintos tipos de dinosaurios.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Este predio esta protegido del viento por el Cerro Los Hornos y por tratarse adem&aacute;s de una depresi&oacute;n natural del terreno.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Al estar en zona de estepa es muy seco y las condiciones clim&aacute;ticas en general son muy agradables. </span> <span style="font-size: small;"> Iniciamos el regreso a las&nbsp;14:00&nbsp;hs. aproximadamente, con una nueva parada en el &ldquo;Parador&rdquo; Hotel La Leona para posteriormente&nbsp; trasladarnos a El Chalt&eacute;n, El Calafate o Aeropuerto FTE alrededor de las 16:30&nbsp;hs.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>&nbsp;</strong></span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Duraci&oacute;n: </strong>8 horas.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Salida:</strong>&nbsp;09:00&nbsp;</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Regreso estimado</strong>: 17:00</span><br>', 'si', 'no', 5, 1420216846, '900.00', 1),
(46, 1, 5, 'Exc. Full Day Torres del Paine (A-G)', '', '<span style="font-size: small;">No incluye entrada al PN Torres de Paine. U$S 38.<br /><strong>Salida:</strong> 05:30 - <strong>Regreso:</strong> 23:00 hs.&nbsp;</span><br>\r\n&nbsp;\r\n<p style="text-align: justify;"><span style="font-size: small;">El Full Day al mundialmente reconocido Parque Nacional Torres del Paine, permite a nuestros visitantes recorrer gran parte del Parque, a trav&eacute;s de los diferentes caminos que rodean el macizo monta&ntilde;oso y descubrir los bell&iacute;simos paisajes de la patagonia Austral chilena, en forma directa (sin necesidad de paso previo por Puerto Natales).Este servicio es brindado con buses de &uacute;ltima generaci&oacute;n, conductores expertos en la zona ygu&iacute;a biling&uuml;e habilitado por la Administraci&oacute;n de Parques Nacionales de Chile. Se parte desde la localidad argentina de El Calafate a partir de las 5.30 hs., desde el hotel donde est&eacute; alojado el pasajero, siempre y cuando se encuentre en un radio de 3 km del centro. Tener en cuenta que este es el horario en el cual se inician los Pick Up desde el centro, porende es un estimado. Alrededor de las 10 de la ma&ntilde;ana, se llegar&aacute; a Frontera (Cerro Castillo); y una vez realizadolos tr&aacute;mites aduaneros, se realizar&aacute; una pausa en la localidad chilena de Cerro Castillo; all&iacute;podr&aacute;n cambiar dinero, tomar un desayuno tradicional, conversar con lugare&ntilde;os, etc. Luego,nuestros pasajeros har&aacute;n trasbordo a buses m&aacute;s peque&ntilde;os, con el objeto de lograr cohesi&oacute;ngrupal, mayor interacci&oacute;n con el gu&iacute;a, el especialista que los acompa&ntilde;ar&aacute; en el trayecto y as&iacute;, maximizar su experiencia en esta visita tan especial. A las 11 hs., aproximadamente, nuestro bus retomar&aacute; camino hacia el Parque; llegando al primeratractivo de nuestro recorrido a las 11.40 hs: el Lago Sarmiento. All&iacute; se har&aacute; una breve parada para tomar las primeras fotograf&iacute;as y disfrutar del imponente paisaje. La pr&oacute;xima parada de esta excursi&oacute;n ser&aacute; en la Porter&iacute;a Laguna Amarga, a las 12.30 hs aproximadamente; all&iacute; se abonar&aacute; el ingreso al Parque Nacional Torres del Paine. Desde este punto, nuestro bus tomar&aacute; rumbo hacia el Lago Nordenskjold, al cual arribar&aacute; 13.00 hs. Se podr&aacute; disfrutar de este bello espejo de agua; reflejando unos de los principales atractivos del Parque: los imponentes &ldquo;Cuernos del Paine&rdquo;. Alrededor de las 13.30 hs, se arribar&aacute; a Pudeto, donde se realizar&aacute; un trekking hacia el Salto Grande, para continuar luego al Mirador de los Cuernos del Paine. Este recorrido en conjunto tiene una duraci&oacute;n aproximada de 1 hora y media. El gu&iacute;a decidir&aacute; en el trayecto, a que mirador asistir&aacute; primero el grupo. Se trata de una caminata de dificultad baja.&nbsp; Luego de disfrutar el paseo, se partir&aacute; hacia la Administraci&oacute;n del Parque Nacional (Conaf), arribando alrededor de las 16 hs. Desde all&iacute;, se emprender&aacute; regreso hacia la zona de Laguna Amarga (16.50/17.00 hs). A las 18 hs, se arribar&aacute; a Cerro Castillo; regresando a El Calafate entre las 22.30/23.00 hs aproximadamente. Incluye: Box lunch (1 Gaseosa o Agua | 1 S&aacute;ndwich Jam&oacute;n y queso | 1 barra de Cereal |1 Paquete degalletas)No incluye: Entrada al Parque Nacional. &bull; La entrada al Parque Nacional debe ser abonada en pesos chilenos. Pueden realizar el cambiode moneda en el paso fronterizo.&bull; Este es un servicio regular Full Day (dia entero) como su nombre indica, la mayor parte delrecorrido es en bus, visto que s&oacute;lo se desciende en los puntos panor&aacute;micos, se hacen caminatasde menor exigencia y conlleva cruzar a Chile por lo que hay tr&aacute;mites migratorios involucradosque pueden retrasar los horarios anteriormente descritos (motivos ajenos a la empresa y alservicio). Es decir los horarios del recorrido son siempre estimativos.&bull; Los horarios establecidos en este programa pueden sufrir variaciones por los tr&aacute;mites queconlleva, y los trayectos que se recorren. Estas demoras son causadas por situaciones sonajenas a la empresa.&bull; El tiempo estimativo en el paso fronterizo cancha carrera y paso fronterizo R&iacute;o Don Guillermodepender&aacute; exclusivamente del trabajo de gendarmer&iacute;a argentina y de polic&iacute;a deinvestigaciones de Chile. <strong>INFORMACION IMPORTANTE A TENER EN CUENTA PARA EL CRUCE A CHILE E INGRESO AL PN:</strong> El gu&iacute;a de la Excursi&oacute;n se sumar&aacute; al grupo en la frontera Chilena. Documentaci&oacute;n: La documentaci&oacute;n y visado obligatorios para viajar son de &iacute;ndole estrictamente personalsiendo, por ello, responsabilidad exclusiva del Pasajero contar con los documentos, pasaportesy visados en perfecto estado y vigencia. La Empresa no ser&aacute; responsable por inconvenientesque sufrieran los Pasajeros que carezcan de tal condici&oacute;n. En caso de que alg&uacute;n Pasajero nopudiera viajar por estas razones, perder&aacute; el total de los servicios contratados, sin derecho a reclamo alguno; lo mismo en caso que las autoridades de cualquier pa&iacute;s rehusaren permitir la entrada del Pasajero. El Pasajero deber&aacute; informarse en el Consulado pertinente sobre los requisitos vigentes que exigen las autoridades migratorias, aduaneras y sanitarias del pa&iacute;s alque tengan programado viajar.&nbsp; Argentino (nativo &oacute; naturalizado) o residente en pa&iacute;ses del Mercosur: DNI o C&eacute;dula deidentidad.&#61656; Otras Nacionalidades: Pasaporte con visa Chilena (De acuerdo a los convenios internacionalesvigentes).Menores: Si viaja con sus hijos deber&aacute; presentar la libreta de casamiento o acta de nacimiento de losmismos. Los menores de edad que salgan del pa&iacute;s solos o acompa&ntilde;ados por uno s&oacute;lo de sus padres deber&aacute;n presentar una autorizaci&oacute;n donde consten los siguientes &iacute;tems:- Menores de 14 a&ntilde;os: lugar de destino y datos personales de la persona que lo recibir&aacute;.- Entre 14 y 18 a&ntilde;os: lugar de destino. Si el menor de 18 a&ntilde;os viaja acompa&ntilde;ado de un mayor que no sea alguno de sus padres, en la autorizaci&oacute;n deber&aacute;n detallarse los datos personales del acompa&ntilde;ante y del lugar de destino. Importante: El permiso o autorizaci&oacute;n de viaje del padre faltante se tramita ante escribano p&uacute;blico y se legaliza ante el Colegio de Escribanos u opcionalmente ante la justicia en lo civil del departamento judicial de su zona. Condiciones clim&aacute;ticas/Fuerza Mayor: La Empresa no se responsabiliza por los hechos que se produzcan por caso fortuito o fuerza mayor, fen&oacute;menos clim&aacute;ticos o hechos de la naturaleza que acontezcan antes o durante el desarrollo del tour, que impidan, demoren o de cualquier modo, obstaculicen la ejecuci&oacute;ntotal o parcial de las prestaciones contratadas. Alteraciones o modificaciones: La empresa se reserva el derecho, por razones t&eacute;cnicas u operativas, de alterar total oparcialmente el ordenamiento diario y/o de servicios que componen el tour, antes o durante laejecuci&oacute;n del mismo. <strong>Ingreso de alimentos:</strong>&nbsp;Est&aacute; vedado el ingreso al territorio chileno de productos y/o subproductos de origen vegetal oanimal en el equipaje del pasajero (Alimentos de tipo vegetal, carnes, chacinados, etc.). Se permite el ingreso de toda mercader&iacute;a encuadrada como equipaje y que no presuma &ldquo;finescomerciales&rdquo;<strong>** CONSULTAR POR PA&Iacute;SES QUE REQUIEREN VISADO PARA EL INGRESO A CHILE&nbsp;&nbsp;</strong></span><br>', 'si', 'no', 5, 1420224478, '1100.00', 1),
(47, 1, 1, 'Est. Cristina Classic', '', '<span style="font-size: small;">Excursi&oacute;n Estancia Cristina Classic. No incluye entrada APN. Se debe abonar con la compra de la excursi&oacute;n.</span><br>\r\n<div id="box_content_title"><strong><span style="font-size: small;">EXCURSION CLASSIC</span></strong></div>\r\n<div><strong><span style="font-size: small;"><br />Salida: </span></strong><span style="font-size: small;">07:00 hs.</span><strong><span style="font-size: small;"> Regreso: </span></strong><span style="font-size: small;">20:00 hs.</span></div>\r\n<div id="box_content_text" class="flexcroll flexcrollactive">\r\n<div id="box_content_text_mcontentwrapper" class="mcontentwrapper">\r\n<div id="box_content_text_contentwrapper" class="contentwrapper"><span class="bold_excursion" style="font-size: small;">Glaciar Upsala + Ea. Cristina + Museo + Visita Hist&oacute;rica y Paseo</span><br /><br /><span style="font-size: small;">Incluye:</span><br /> \r\n<ul>\r\n<li><span style="font-size: small;">Embarque y salida en Puerto de Punta Bandera (APN) a las 08.15 horas en una moderna y confortable embarcaci&oacute;n.</span></li>\r\n<li><span style="font-size: small;">Navegaci&oacute;n entre t&eacute;mpanos e imponentes paisajes con vistas del frente occidental del Glaciar Upsala y de all&iacute; por el Canal Cristina hasta el punto de desembarque en la Estancia.</span></li>\r\n<li><span style="font-size: small;">Arribo a Estancia Cristina 11:30 horas.</span></li>\r\n<li><span style="font-size: small;">Permanencia en la Estancia 6 horas.</span></li>\r\n<li><span style="font-size: small;">Visita guiada al Museo Costumbrista (antiguo Galp&oacute;n de Esquila).</span></li>\r\n<li><span style="font-size: small;">Caminata guiada hasta R&iacute;o Caterina y la Capilla, y recorrido por el casco de la Estancia.</span></li>\r\n<li><span style="font-size: small;">Regreso a la embarcaci&oacute;n 17.30 horas. Llegada a Puerto Bandera aproximadamente 19.00 horas.</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>', 'si', 'no', 5, 1420225079, '1100.00', 1),
(48, 1, 1, 'Est. Cristina Discovery', '', '<span style="font-size: small;">Exc. Estancia Cristina Discovery.  No incluye entrada APN, se cobra junto con la excursi&oacute;n.</span><br>\r\n<div id="box_content_title"><strong><span style="font-size: small;">EXCURSION DISCOVERY</span></strong></div>\r\n<div></div>\r\n<div><strong><span style="font-size: small;">Salida: </span></strong><span style="font-size: small;">07:00 hs.</span><strong><span style="font-size: small;"> Regreso: </span></strong><span style="font-size: small;">20:00 hs.</span></div>\r\n<div id="box_content_text_tarifas" class="flexcroll flexcrollactive">\r\n<div id="box_content_text_tarifas_mcontentwrapper" class="mcontentwrapper">\r\n<div id="box_content_text_tarifas_contentwrapper" class="contentwrapper"><span class="bold_excursion" style="font-size: small;">Glaciar Upsala + Ea. Cristina + 4X4 Mirador Upsala (ida y vuelta) + Museo&nbsp;</span><br /><br /><span style="font-size: small;">Duraci&oacute;n de la traves&iacute;a 4x4: 3 horas&nbsp;</span><br /><span style="font-size: small;">Desnivel: 550 m.s.n.m.</span><br /><span style="font-size: small;">Nivel de exigencia: Bajo&nbsp;</span><br /><br /><span style="font-size: small;">Incluye:</span><br /> \r\n<ul>\r\n<li><span style="font-size: small;">Embarque y salida en Puerto de Punta Bandera (APN) a las 08.15 horas en una moderna y confortable embarcaci&oacute;n.</span></li>\r\n<li><span style="font-size: small;">Navegaci&oacute;n entre t&eacute;mpanos e imponentes paisajes con vistas del frente occidental del Glaciar Upsala y de all&iacute; por el Canal Cristina hasta el punto de desembarque en la Estancia.</span></li>\r\n<li><span style="font-size: small;">Arribo a Estancia Cristina alrededor de las 11:30 horas.</span></li>\r\n<li><span style="font-size: small;">Permanencia en la Estancia 6 horas.</span></li>\r\n<li><span style="font-size: small;">Visita guiada al Museo Costumbrista de la Estancia (antiguo Galp&oacute;n de Esquila).</span></li>\r\n<li><span style="font-size: small;">Ascenso en veh&iacute;culos todo terreno, recorriendo 9.5 km por camino de monta&ntilde;a.</span></li>\r\n<li><span style="font-size: small;">Llegada al refugio de Hielos Continentales.</span></li>\r\n<li><span style="font-size: small;">Caminata de 30 minutos sobre terreno de erosi&oacute;n glaciaria.</span></li>\r\n<li><span style="font-size: small;">Vista priviliegiada del frente Oriental del Glaciar Upsala, Lago Guillermo, Hielo Patag&oacute;nico Sur y Cordillera de los Andes.</span></li>\r\n<li><span style="font-size: small;">Regreso al Casco de la Estancia y embarque 17.30 horas. Llegada a Puerto Bandera 19.00 horas aproximadamente.</span></li>\r\n</ul>\r\n<br /><span style="font-size: small;">NOTA: En caso de que el cupo m&aacute;ximo de pasajeros sea sobrepasado, los visitantes ser&aacute;n divididos en turnos por el coordinador de excursiones de la Estan</span>cia.</div>\r\n</div>\r\n</div>\r\n<span style="font-size: small;"><br /></span><br>', 'si', 'no', 5, 1420225422, '1480.00', 1),
(49, 1, 1, 'Est. Cristina Trekking', '', '<strong><span style="font-size: small;">No admite menores de 12 a&ntilde;os. No incluye entrada APN. Se cobra junto a la excursi&oacute;n.</span></strong><br>\r\n<div id="box_content_title"><span style="font-size: small;"><strong>EXCURSION CA&Ntilde;AD&Oacute;N DE LOS F&Oacute;SILES</strong></span></div>\r\n<div></div>\r\n<div><span style="font-size: small;"><strong>Salida: </strong>07:00 hs<strong>. Regreso: </strong>20:00 hs.</span></div>\r\n<div id="box_content_text_tarifas" class="flexcroll flexcrollactive">\r\n<div id="box_content_text_tarifas_mcontentwrapper" class="mcontentwrapper">\r\n<div id="box_content_text_tarifas_contentwrapper" class="contentwrapper">\r\n<p style="text-align: justify;"><span style="font-size: small;">Glaciar Upsala + Ea. Cristina + 4X4 Mirador Upsala + Trekking Ca&ntilde;ad&oacute;n de los F&oacute;siles</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Duraci&oacute;n: 5.30 horas&nbsp;</span><br /><span style="font-size: small;">Desnivel: 550 m.s.n.m.</span><br /><span style="font-size: small;">Nivel de exigencia: Medio-Alto.</span><br /><span style="font-size: small;">Se recomienda tener buena condici&oacute;n f&iacute;sica.</span><br>\r\n<ul style="text-align: justify;">\r\n<li><span style="font-size: small;">Embarque y salida en Puerto de Punta Bandera (APN) a las 08 horas en una moderna y confortable embarcaci&oacute;n.</span></li>\r\n<li><span style="font-size: small;">Navegaci&oacute;n entre t&eacute;mpanos e imponentes paisajes con vistas del frente occidental del Glaciar Upsala y de all&iacute; por el Canal Cristina hasta el punto de desembarque en la Estancia.</span></li>\r\n<li><span style="font-size: small;">Arribo a Estancia Cristina 11 horas.</span></li>\r\n<li><span style="font-size: small;">Permanencia en la Estancia 6 horas.</span></li>\r\n<li><span style="font-size: small;">Ascenso en veh&iacute;culos todo terreno, recorriendo 9.5 km por camino de monta&ntilde;a.</span></li>\r\n<li><span style="font-size: small;">Se recorre un paisaje que hasta hace muy poco estuvo cubierto por glaciares y que tiene un gran inter&eacute;s geol&oacute;gico.</span></li>\r\n<li><span style="font-size: small;">Vista privilegiada del frente Oriental del Glaciar Upsala, Lago Guillermo, Hielo Patag&oacute;nico Sur y Cordillera de los Andes.</span></li>\r\n<li><span style="font-size: small;">Descenso en b&uacute;squeda del Ca&ntilde;ad&oacute;n de los F&oacute;siles, yacimiento de restos f&oacute;siles marinos.Valle de caracter&iacute;sticas &uacute;nicas dentro del parque.</span></li>\r\n<li><span style="font-size: small;">Edad m&iacute;nima: 12 a&ntilde;os, acompa&ntilde;ados por sus padres.</span></li>\r\n<li><span style="font-size: small;">Los que opten por esta actividad, almorzaran durante el paseo, y regresar&aacute;n a la Estancia para luego abordar el barco a las 17 horas.</span></li>\r\n<li><span style="font-size: small;">Llegada a Puerto Bandera 19 horas aproximadamente.</span></li>\r\n</ul>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>NOTA:</strong>&nbsp;En el caso que coordinador de excursiones de Estancia Cristina, determine que los pasajeros que hayan elegido esta actividad no est&aacute;n en condiciones f&iacute;sicas o carecen de la vestimenta adecuada para realizar el trekking, no podr&aacute;n desarrollarla, no aceptando reclamos ni devoluci&oacute;n alguna</span>.<br>\r\n</div>\r\n</div>\r\n</div>\r\n<p style="text-align: justify;"><strong><span style="font-size: small;"><br /></span></strong><br>', 'si', 'no', 5, 1420225817, '1640.00', 1),
(50, 1, 5, 'Exc. Est. Nibepo Aike', '', '<strong><span style="font-size: small;">Visita con alzo o cena y actividades. </span></strong><br>\r\n<strong><span style="font-size: small;">Salida: </span></strong><span style="font-size: small;">08:30 hs.</span><strong><span style="font-size: small;"> Regreso: </span></strong><span style="font-size: small;">15:30 hs. (almuerzo)</span><strong><span style="font-size: small;"> <br />Salida: </span></strong><span style="font-size: small;">16:00 hs.</span><strong><span style="font-size: small;"> Regreso: </span></strong><span style="font-size: small;">22:30 hs. (cena)</span><br>\r\n<strong><span style="font-size: small;">Cabalgata opcional.</span></strong><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">El establecimiento est&aacute; ubicado en la zona sur del Parque Nacional Los Glaciares, inmerso en un bello paisaje cordillerano, se pueden &nbsp;realizar distintas actividades.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Es la &uacute;nica estancia tur&iacute;stica dentro del Parque Nacional Los Glaciares, donde conviven las tradicionales actividades de estancia junto con la actividad tur&iacute;stica. Ubicada a 56 km de El Calafate, frente al majestuoso Lago Roca. &nbsp;</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Luego de ser recogidos en su hotel, se parte desde El Calafate por el viejo camino de las estancias, ruta provincial 15. Se atraviesan las estancias Huyliche, Anita y Alta Vista, realizando diversas paradas en puntos panor&aacute;micos que permiten ver desde perspectivas muy poco comunes, el Glaciar Perito Moreno, la Cordillera y los lagos Argentino y Roca. El trayecto en veh&iacute;culo de 56 km desde El Calafate se combina con caminatas, para poder estar m&aacute;s en contacto con la naturaleza. Todo el tiempo el gu&iacute;a est&aacute; a disposici&oacute;n de los pasajeros para contar la historia del lugar, la geograf&iacute;a, la fauna y la flora aut&oacute;ctona.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Al arribar a la Estancia Nibepo Aike, se disfruta de un almuerzo o cena, que incluye asado de cordero patag&oacute;nico. Hay una opci&oacute;n de almuerzo vegetariano org&aacute;nico.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Luego se puede participar de las actividades de esquila y arreo, hacer una caminata hasta la costa del Lago o una cabalgata acompa&ntilde;ados de un baqueano (cabalgata no incluida en el precio), subiendo al Cerro Cristal, desde donde la vista panor&aacute;mica es incre&iacute;ble y visitar la huerta org&aacute;nica. Con posterioridad comienza el regreso a El Calafate, bordeando la margen sur del Lago Argentino.</span><br>\r\n<p style="text-align: justify;"><strong><span style="font-size: small;"><br /></span></strong><br>', 'si', 'no', 5, 1420226202, '900.00', 1),
(51, 1, 5, 'Est. 25 de Mayo con Alzo', '', '<span style="font-size: small;"><strong>Excursi&oacute;n con actividades. Almuerzo. 09:30 a 14:00 horas. Incluye traslados in - out</strong>.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Descubra la fascinante historia de Estancia 25 de Mayo, en uno de los ambientes naturales m&aacute;s deslumbrantes del mundo, el establecimiento cuenta con m&aacute;s de 17.000 hect&aacute;reas y su antiguo casco ubicado a pasos de el centro de El Calafate, un lugar ideal donde poder descansar y disfrutar del paisaje al pie del Cerro Calafate, respirando el m&aacute;s puro aire patag&oacute;nico.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Ma&ntilde;ana con almuerzo:</strong></span><br>\r\n<ul>\r\n<li><span style="font-size: small;">09:30 hs. Recepci&oacute;n con mate y tortas fritas.</span></li>\r\n<li><span style="font-size: small;">Caminata por sendero Arroyo Calafate.</span></li>\r\n<li><span style="font-size: small;">Visita al Antiguo Galp&oacute;n de Esquila, corrales y ba&ntilde;o de ovejas de la Estancia.</span></li>\r\n<li><span style="font-size: small;">Demostraci&oacute;n de Esquila.</span></li>\r\n<li><span style="font-size: small;">Arreo de ovejas con perros.</span></li>\r\n<li><span style="font-size: small;">Almuerzo en restaurante &ldquo;El Quincho&rdquo;.</span></li>\r\n<li><span style="font-size: small;">13:30 hs. Fin de la Excursi&oacute;n.</span></li>\r\n</ul>', 'si', 'no', 6, 1420227214, '440.00', 1),
(52, 1, 5, 'Est. 25 de Mayo cena - show folklorico', '', '<span style="font-size: small;"><strong>Excursi&oacute;n. Actividades, cena con show folklorico. Incluye trf in - out. </strong></span><br>\r\n<span style="font-size: small;"><strong>Salida: </strong>17:30 hs.<strong> Regreso: &nbsp;</strong>23:00 hs.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Descubra la fascinante historia de Estancia 25 de Mayo, en uno de los ambientes naturales m&aacute;s deslumbrantes del mundo, el establecimiento cuenta con m&aacute;s de 17.000 hect&aacute;reas y su antiguo casco ubicado a pasos de el centro de El Calafate, un lugar ideal donde poder descansar y disfrutar del paisaje al pie del Cerro Calafate, respirando el m&aacute;s puro aire patag&oacute;nico.</span><br>\r\n<ul style="text-align: justify;">\r\n<li><span style="font-size: small;">18:00 hs. Recepci&oacute;n con mate, tortas fritas y el tradicional Caf&eacute; Carretero Patag&oacute;nico.</span></li>\r\n<li><span style="font-size: small;">Demostraci&oacute;n de arreo de ovejas con perros.</span></li>\r\n<li><span style="font-size: small;">Visita al Antiguo Galp&oacute;n de Esquila, corrales y ba&ntilde;o de ovejas de la Estancia.</span></li>\r\n<li><span style="font-size: small;">Demostraci&oacute;n de Esquila de ovejas.</span></li>\r\n<li><span style="font-size: small;">Caminata por sendero Arroyo Calafate.</span></li>\r\n<li><span style="font-size: small;">Degustaci&oacute;n de vinos acompa&ntilde;ado de cordero confitado en el mirador del Arroyo.</span></li>\r\n<li><span style="font-size: small;">Video de los pioneros de El Calafate.</span></li>\r\n<li><span style="font-size: small;">20:30 hs. Fin de la Excursi&oacute;n.</span></li>\r\n</ul>\r\n<p style="text-align: justify;">&nbsp;<br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong><br /></strong></span><br>', 'si', 'no', 5, 1420227692, '640.00', 1),
(53, 1, 5, 'Est. 25 de Mayo tarde con actividades', '', '<span style="font-size: small;"><strong>Excursi&oacute;n. Actividades. No incluye cena. Incluye Trf in - out.</strong></span><br>\r\n<span style="font-size: small;"><strong>Salida: </strong>17:30 hs.<strong> Regreso: </strong>21:00 hs.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Descubra la fascinante historia de Estancia 25 de Mayo, en uno de los ambientes naturales m&aacute;s deslumbrantes del mundo, el establecimiento cuenta con m&aacute;s de 17.000 hect&aacute;reas y su antiguo casco ubicado a pasos de el centro de El Calafate, un lugar ideal donde poder descansar y disfrutar del paisaje al pie del Cerro Calafate, respirando el m&aacute;s puro aire patag&oacute;nico.</span><br>\r\n<ul style="text-align: justify;">\r\n<li><span style="font-size: small;">18:00 hs. Recepci&oacute;n con mate, tortas fritas y el tradicional Caf&eacute; Carretero Patag&oacute;nico.</span></li>\r\n<li><span style="font-size: small;">Demostraci&oacute;n de arreo de ovejas con perros.</span></li>\r\n<li><span style="font-size: small;">Visita al Antiguo Galp&oacute;n de Esquila, corrales y ba&ntilde;o de ovejas de la Estancia.</span></li>\r\n<li><span style="font-size: small;">Demostraci&oacute;n de Esquila de ovejas.</span></li>\r\n<li><span style="font-size: small;">Caminata por sendero Arroyo Calafate.</span></li>\r\n<li><span style="font-size: small;">Degustaci&oacute;n de vinos acompa&ntilde;ado de cordero confitado en el mirador del Arroyo.</span></li>\r\n<li><span style="font-size: small;">Video de los pioneros de El Calafate.</span></li>\r\n<li><span style="font-size: small;">20:30 hs. Fin de la Excursi&oacute;n.</span></li>\r\n</ul>\r\n<p style="text-align: justify;">&nbsp;<br>\r\n<span style="font-size: small;"><strong><br /></strong></span><br>', 'si', 'no', 5, 1420227819, '340.00', 1),
(54, 1, 5, 'Est. 25 de Mayo solo cena-show folklorico', '', '<span style="font-size: small;"><strong>Cena con show folklorico. Incluye trf in - out.</strong></span><br>\r\n<span style="font-size: small;"><strong>Salida: </strong>20:00 hs.<strong> Regreso: </strong>23:00 hs.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Descubra la fascinante historia de Estancia 25 de Mayo, en uno de los ambientes naturales m&aacute;s deslumbrantes del mundo, el establecimiento cuenta con m&aacute;s de 17.000 hect&aacute;reas y su antiguo casco ubicado a pasos de el centro de El Calafate, un lugar ideal donde poder descansar y disfrutar del paisaje al pie del Cerro Calafate, respirando el m&aacute;s puro aire patag&oacute;nico.</span><br>\r\n<ul>\r\n<li><span style="font-size: small;">20:30 hs. Arribo a la Estancia.</span></li>\r\n<li><span style="font-size: small;">Cena en restaurante &ldquo;El Quincho&rdquo;. </span>\r\n<ul>\r\n<li><span style="font-size: small;">Entrada: Empanadas criollas y escabeches.</span></li>\r\n<li><span style="font-size: small;">Principal: Parrilla de cordero patag&oacute;nico al asador acompa&ntilde;ado de otros cortes y ensaladas de la huerta org&aacute;nica.</span></li>\r\n<li><span style="font-size: small;">Postre: Flan casero con dulce de leche.</span></li>\r\n<li><span style="font-size: small;">Show Folkl&oacute;rico&nbsp; artistas locales, recorrido por las danzas t&iacute;picas del pa&iacute;s.</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<span style="font-size: small;"> 22:30 hs. Fin de la Excursi&oacute;n</span><br>\r\n<span style="font-size: small;"><strong><br /></strong></span><br>', 'si', 'no', 5, 1420227927, '340.00', 1),
(55, 1, 5, 'Safari Experience', '', '<strong><span style="font-size: small;">Excursi&oacute;n. Almuerzo o cena incluida. <br /><br />Salida: </span></strong><span style="font-size: small;">09:00 hs.</span><strong><span style="font-size: small;"> Regreso: </span></strong><span style="font-size: small;">14:30 hs. </span><strong><span style="font-size: small;"><br />Salida: </span></strong><span style="font-size: small;">16:00 hs.</span><strong><span style="font-size: small;"> Regreso: </span></strong><span style="font-size: small;">21:30 hs.</span><br>\r\n<p class="text_bold" style="text-align: justify;"><span style="font-size: small;">Recorrido total: 50 Km</span><br /><span style="font-size: small;">Duraci&oacute;n de la traves&iacute;a: 4 horas</span><br /><span style="font-size: small;">Salidas: Ma&ntilde;ana y tarde</span><br>\r\n<p class="text_bold" style="text-align: justify;"><span style="font-size: small;">Incluye:</span><br /><span style="font-size: small;">-&nbsp;<span class="text">Entrada a la Reserva Natural Estancia 25 de Mayo<br />- Expedici&oacute;n en 4x4 por la Reserva.</span></span><br /><span class="text" style="font-size: small;">- Avistaje de fauna aut&oacute;ctona.<br />- Safari Fotogr&aacute;fico.<br />- Exploraci&oacute;n de f&oacute;siles marinos.</span><br /><span class="text" style="font-size: small;">- Interpretaci&oacute;n Ambiental.<br />- Almuerzo o cena en un autentico puesto de estancia.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Para los amantes de las aves, Patagonia Profunda ofrece un sinf&iacute;n de h&aacute;bitats que van desde costas de lago, vegas, arroyos y r&iacute;os, estepa con altitudes que oscilan los 200 msnm hasta los 1.300 msnm, bosques de lengas, etc.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">En tan diversos h&aacute;bitats podemos encontrar amplia variedad de aves, siendo las m&aacute;s representativas el c&oacute;ndor andino, el &aacute;guila mora, el avestruz patag&oacute;nico, la monjita chocolate, as&iacute; como agachonas, raras, yales y dormilonas.</span><br>\r\n<div id="sub_patagonia_text">\r\n<div>\r\n<table border="0" width="312" height="258">\r\n<tbody>\r\n<tr>\r\n<td class="text">\r\n<p style="text-align: justify;"><span style="font-size: small;"><span class="text_bold">Ubicaci&oacute;n:</span>&nbsp;El Calafate, Provincia de Santa Cruz.</span><br /><span style="font-size: small;"><span class="text_bold">Superficie:</span>&nbsp;16.000 has.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">La Fundaci&oacute;n de Historia Natural F&eacute;lix de Azara ha declarado a la "estancia 25 de Mayo" como Reserva Natural Privada.</span><br /><span style="font-size: small;">En la misma se han detectado &aacute;reas que geol&oacute;gica y paleontol&oacute;gicamente son &uacute;nicas en la Argentina, entre ellas se destacan uno de los yacimientos de cangrejos f&oacute;siles&nbsp;<span class="text_bold">&nbsp;</span>m&aacute;s importantes del mundo, un arrecife de ostras, y formaciones que contienen restos de mam&iacute;feros f&oacute;siles con una antig&uuml;edad aproximada de 15 millones de a&ntilde;os.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Dr. Silvio Casad&iacute;o</span><br>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<p class="text_bold"><span class="text"><br /></span><br>\r\n<span style="font-size: small;"><br /></span><br>', 'si', 'no', 5, 1420228219, '640.00', 1),
(22, 1, 5, 'Glaciobar', '', 'El Glaciobar Branca es el primer bar de hielo en Argentina y el &uacute;nico con hielo de glaciar. Imperdible para vivir una experiencia inolvidable bajo cero. Tiene capacidad para 25 personas y el tiempo m&aacute;ximo de estad&iacute;a es de 20 minutos. Los visitantes reciben previo al ingreso una capa, guantes y botas. Igualmente se recomienda vestir ropa de abrigo.  Una nueva opci&oacute;n para completar su visita a El Calafate y el Glaciar Perito Moreno. &iexcl;Vale la pena!.   Dificultad: No tiene, apta para todas las edades  Incluye:  Transporte desde Hotel ida y vuelta.<br>', 'si', 'si', 20, 1405007745, '140.00', 1),
(23, 1, 5, 'La Rivera del Lago c/alzo', '', '<p style="text-align: justify;"><span style="font-size: small;"><strong>Salida:</strong> 10:00 hs. <strong>Regreso: </strong>13:30 hs.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Incluye almuerzo.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Traves&iacute;a en 4x4, La RIVERA DEL LAGO ARGENTINO Conocer estas tierras sin condiciones, desafiar los obst&aacute;culos que la naturaleza impone para llegar a puntos panor&aacute;micos privilegiados y casi inexplorados. Por la diversidad de geograf&iacute;as y atractivos que ofrece la Patagonia, como sus costas recortadas y acantiladas, la interminable estepa rica en f&oacute;siles, flora y fauna&hellip; y el marco de la cordillera de los andes y del lago argentino la convierten en un escenario &uacute;nico para la actividad de 4x4. Recorrer caminos apenas transitables o aventurarse por lugares donde las rutas sencillamente no existen, es la propuesta de estas salidas. Una alternativa para lograr un contacto pleno con la naturaleza respetando y protegiendo el medio que se visita  RECORRIDO Salimos de Calafate en camionetas 4x4 Land Rover Defender, relizamos s&oacute;lo 5 km de ruta asfaltada. Luego atravesamos una tranquera para ingresar por campos de estancias, en direcci&oacute;n a la costa del Lago Argentino..El tipo de terreno a transitar son huellas de ripio, por momentos cubiertas de nieve, sobre la t&iacute;pica estepa patag&oacute;nica, con abundantes coirones, variedad de matas y arbustos de Calafate.Pasamos lagunas congeladas y vadeamos el r&iacute;o Centinela ..Subimos la meseta m&aacute;s alta de la zona, alcanzando un punto panor&aacute;mico de 300 mts s.n.m., observando el acantilado que cae abruptamente hacia el lago, avistando adem&aacute;s sitios arqueol&oacute;gicos. Descendemos la meseta por zonas de dunas , m&eacute;danos y playa. Al llegar a un reparado sitio junto al r&iacute;o Centinela, bien protegido por matas y arbustos de Calafate, nos espera un calentito almuerzo. (Recreando de alguna manera, lo que los antiguos viajantes que cargaban lana realizaban en la zona de Calafate&hellip;eleg&iacute;an como posta esta zona, junto al r&iacute;o y al reparo de los arbustos&hellip;) Finalizado el picnic junto al fog&oacute;n, emprendemos el regreso, por otra huella que sale a la ruta frente al Cerro Comisi&oacute;n, desde all&iacute; tenemos 10 km de asfalto hasta Calafate.&nbsp;</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Preparamos en el momento bifes al disco, servidos en s&aacute;ndwich, con bebidas(gaseosa, agua, vino) y frutas.</span><br>', 'si', 'no', 5, 1405008718, '710.00', 1),
(24, 1, 5, 'La Rivera del Lago c/merienda', '', '<p style="text-align: justify;"><span style="font-size: small;"><strong>Salida:</strong> 14:00 hs. <strong>Regreso:</strong> 17:30 hs.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Traves&iacute;a en 4x4, LA RIVERA DEL LAGO ARGENTINO conocer estas tierras sin condiciones, desafiar los obst&aacute;culos que la naturaleza impone para llegar a puntos panor&aacute;micos privilegiados y casi inexplorados. Por la diversidad de geograf&iacute;as y atractivos que ofrece la Patagonia, como sus costas recortadas y acantiladas, la interminable estepa rica en f&oacute;siles, flora y fauna&hellip; y el marco de la cordillera de los andes y del lago argentino la convierten en un escenario &uacute;nico para la actividad de 4x4. Recorrer caminos apenas transitables o aventurarse por lugares donde las rutas sencillamente no existen, es la propuesta de estas salidas. Una alternativa para lograr un contacto pleno con la naturaleza respetando y protegiendo el medio que se visita  RECORRIDO Salimos de Calafate en camionetas 4x4 Land Rover Defender, relizamos s&oacute;lo 5 km de ruta asfaltada. Luego atravesamos una tranquera para ingresar por campos de estancias, en direcci&oacute;n a la costa del Lago Argentino..El tipo de terreno a transitar son huellas de ripio, por momentos cubiertas de nieve, sobre la t&iacute;pica estepa patag&oacute;nica, con abundantes coirones, variedad de matas y arbustos de Calafate..Pasamos lagunas congeladas y vadeamos el r&iacute;o Centinela ..Subimos la meseta m&aacute;s alta de la zona, alcanzando un punto panor&aacute;mico de 300 mts s.n.m., observando el acantilado que cae abruptamente hacia el lago, avistando adem&aacute;s sitios arqueol&oacute;gicos. Descendemos la meseta por zonas de dunas , m&eacute;danos y playa. Al llegar a un reparado sitio junto al r&iacute;o Centinela, bien protegido por matas y arbustos de Calafate, nos espera una merienda campestre. (Recreando de alguna manera, lo que los antiguos viajantes que cargaban lana realizaban en la zona de Calafate&hellip;eleg&iacute;an como posta esta zona, junto al r&iacute;o y al reparo de los arbustos&hellip;) Finalizado el picnic junto al fog&oacute;n, emprendemos el regreso, por otra huella que sale a la ruta frente al Cerro Comisi&oacute;n, desde all&iacute; tenemos 10 km de asfalto hasta Calafate. </span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"> Merienda: preparamos en el momento, tortas fritas en el disco, con chocolate caliente y mate.</span><br>', 'si', 'no', 5, 1405009121, '520.00', 1),
(40, 1, 1, 'Glaciar Sur Pioneros', '', '<span style="font-size: small;"><strong>No acepta menores de de 6 a&ntilde;os.<br /></strong></span><span style="font-size: small;"><strong>Incluye Alzo. <br />No incluye Entrada APN.</strong></span> <span style="font-size: small;"><strong><br />Salida: </strong>09:00 hs.<strong> Regreso: </strong>19:30 hs.</span><br>\r\n<p class="font_8" style="text-align: justify;"><span class="color_16" style="font-size: small;">Es una excursi&oacute;n dirigida a personas que desean disfrutar del entorno natural &nbsp;sin la necesidad de realizar un esfuerzo f&iacute;sico importante .</span><br>\r\n<p class="font_8" style="text-align: justify;"><span style="font-size: small;">El recorrido</span><span style="font-size: small;">Comienza en Calafate a las 9.30 hs, se recorren 50 kms por la ruta de estancias hasta el Lago Roca, e ingresamos al Camping hom&oacute;nimo, en un &aacute;rea apartada del mismo se encuentra emplazado nuestro Domo con una vista privilegiada. A la llegada se ofrece un brindis de bienvenida acompa&ntilde;ado con una tabla de fiambres y quesos, momento adecuado para distenderse y disfrutar del paisaje o interactuar con los pocos pasajeros que integran el grupo.</span><br>\r\n<p class="font_8" style="text-align: justify;"><span style="font-size: small;">El domo</span><span style="font-size: small;">Pasados 20 minutos el personal que integra nuestro equipo comenzar&aacute; a cocinar en sendos discos de arado los ojos de bife y las verduras grilladas (zuccinis, berenjenas, pimientos cebollas y zanahorias) Cuando todo est&aacute; pronto se ingresa al domo comedor donde ya est&aacute;n armadas las mesas y vajilla. Luego del distendido almuerzo, en veh&iacute;culo se recorren 5 kms hasta nuestro puerto y embarcar hacia Playa de las Monedas en el Brazo Rico, all&iacute; se desembarca y luego de una tranquila caminata de 20 minutos dentro del bosque de lengas salimos a un mirador desde donde se divisa la cara sur del Glaciar Moreno. Se vuelve a embarcar para continuar navegando frente a la cara sur. Antes de despedirse de la embarcaci&oacute;n la tripulaci&oacute;n &ldquo;pesca&rdquo; un t&eacute;mpano y se ofrece un whisky o vodka destilado en Calafate con hielo del glaciar. A las 15.30 hs aprox.</span><br>\r\n<p class="font_8" style="text-align: justify;"><strong style="font-size: small;">El regreso</strong><br>\r\n<p class="font_8" style="text-align: justify;"><span style="font-size: small;">Se desembarca en el Bajo de las Sombras y en veh&iacute;culo los pasajeros se dirigen a las pasarelas del glaciar para arribar a las mismas a las 16 hs, donde permanecer&aacute;n hasta las 18.30 hs y luego regresar a Calafate por la ruta tradicional.</span><br>\r\n<p class="font_8" style="text-align: justify;"><span class="color_16" style="font-size: small;">Es importante destacar que al arribo a pasarelas el 90 % de los visitantes que partieron de Calafate por la ma&ntilde;ana ya habr&aacute;n regresado a la ciudad.</span><br>\r\n<p class="font_8" style="text-align: justify;"><span style="font-size: small;">Todo el servicio de almuerzo con bebidas sin alcohol y vino como as&iacute; tambi&eacute;n el brindis en la embarcaci&oacute;n est&aacute;n incluidos en el costo de la excursi&oacute;n. Los pasajeros est&aacute;n acompa&ntilde;ados desde la salida de Calafate por un Gu&iacute;a biling&uuml;e (ingl&eacute;s/espa&ntilde;ol, eventualmente italiano portugu&eacute;s)</span><br>\r\n<p style="text-align: justify;">&nbsp;<br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>&nbsp;</strong></span><br>', 'si', 'no', 5, 1420213010, '2025.00', 1),
(26, 1, 5, 'City tour c/cuevas del Wualichu', '', '<p style="text-align: justify;"><strong><span style="font-size: small;">Salida: </span></strong><span style="font-size: small;">09:00 hs.</span><strong><span style="font-size: small;"> Regreso: </span></strong><span style="font-size: small;">12:00 hs.</span><strong><span style="font-size: small;"><br /></span></strong><strong><span style="font-size: small;">Salida: </span></strong><span style="font-size: small;">15:00 hs.</span><strong><span style="font-size: small;"> Regreso: </span></strong><span style="font-size: small;">18:00 hs.</span><span style="font-size: small;">&nbsp;</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Un paseo que lleva a lugares cercanos y lejanos en el tiempo. El recorrido se realiza en un bus con sistema de video y un gu&iacute;a que transmitir&aacute; la historia de los primeros pobladores de Calafate, y observaci&oacute;n de lugares de inter&eacute;s. Visita al Centro de interpretaci&oacute;n Hist&oacute;rica y La Laguna Nimes, el mirador de Calafate desde donde se tiene una vista panor&aacute;mica de la villa, y las Cuevas del Walichu. Hacia el este de Calafate, sobre la costa del Lago Argentino se encuentran paredes y cuevas donde los hombres primitivos de la zona dejaron testimonio de su paso por el lugar. Se pueden ver manos en negativo, escenas de caza,  figuras humanas y otras representaciones. El entorno con la vista de la playa y las cuevas es magn&iacute;fico.  Salidas diarias. Duraci&oacute;n del tour: 3 horas. </span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Incluye ingreso a Punta Walichu y al Centro de interpretaci&oacute;n hist&oacute;rica.</span><br>', 'si', 'no', 5, 1405089165, '360.00', 1),
(27, 1, 5, 'Cerro Frías 4x4 con Alzo', '', '<span style="font-size: small;"><strong>Salida:</strong> 09:00 hs. <strong>Regreso:</strong> 14:30</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">La Traves&iacute;a 4X4 consiste en un ascenso que comienza por el faldeo este del Cerro Fr&iacute;as ubicado a 23 km de EL Calafate, dentro de la Estancia Alice, &nbsp;con vista al cuerpo principal del Lago Argentino, alcanzando un primer mirador natural a los 450 mts. de altura. Contin&uacute;a el recorrido, con vista a la Boca del Diablo y la Pen&iacute;nsula de Avellaneda, hasta alcanzar los 1030 mts. Desde la cima, la vista alcanza el Cerro Fitz Roy (200 km al norte) y el Macizo de Paine (Chile)</span>.<br>\r\n<p style="text-align: justify;"><span style="font-size: small;">La vista panor&aacute;mica desde Cerro Fr&iacute;as ofrece una interesante introducci&oacute;n a la regi&oacute;n geogr&aacute;fica y sus encantos, pudiendo divisar desde la cima los principales cerros de la cordillera, los l&iacute;mites del Parque Nacional y los hitos hist&oacute;ricos de los diferentes exploradores.</span><br /><span style="font-size: small;"> El descenso se realiza por el faldeo sur, con vista al Valle del Centinela, hasta la base donde se encuentra el Quincho de Campo. Durante el recorrido, es posible el avisaje de animales silvestres como guanacos, zorros, c&oacute;ndores y liebres.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Limitaciones: Esta actividad no tiene limitaciones, puede ser realizada por personas de todas las edades en diferentes condiciones de estado f&iacute;sico.&nbsp;</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Se disfruta de un t&iacute;pico asado argentino con vegetales grillados, cocido en nuestros hornos de barro en el Quincho de la Estancia Alice, donde los pasajeros podr&aacute;n relajarse y disfrutar del entorno antes de regresar a El Calafate.&nbsp;</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Se recomienda llevar suficiente abrigo, lentes, sombrero y protectores solares.</span><br>', 'si', 'no', 5, 1405347859, '710.00', 1),
(28, 1, 5, 'Enjoy Calafate', '', '<p style="text-align: justify;"><span style="font-size: small;"><strong>Horarios: </strong>9.30 hs - 14.30 hs - 18.00 hs </span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Duracion de la excursion: 3 hs. Los grupos son de hasta 10 pax. Edad permitida: 10 a 55 a&ntilde;os. Se permite un menor de entre 4 y 9 a&ntilde;os por grupo que solo podra realizar tirolesa con un guia. No admite menores de 4 a&ntilde;os.</span><br>\r\n<p style="text-align: justify;"><strong style="font-size: small;">Enjoy!:</strong><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Es una empresa de turismo aventura basada en actividades de monta&ntilde;a. Aprovechamos los marcos naturales que nos brinda la Patagonia argentina para desarrollar actividades al aire libre de forma placentera y segura ofreciendo un excelente est&aacute;ndar de calidad de servicio al turista, propiciando que su visita a la Patagonia sea una experiencia inolvidable! Nos encontramos ubicados a solo 10 minutos del centro comercial de El Calafate &nbsp;sobre la ladera del Cerro del mismo nombre. En este marco natural de estepa patag&oacute;nica es donde desarrollamos un circuito integrado de actividades de monta&ntilde;a con grupos reducidos de personas, con gu&iacute;as especializados y con experiencia en actividades outdoor de hace mas de 15 a&ntilde;os. Prestamos servicios de transfer in y out desde el hotel y&nbsp;gu&iacute;as&nbsp;biling&uuml;es personalizados durante todo el recorrido. Enjoy! Se encuentra dentro de la reserva natural privada 25 de mayo, desde donde se aprecia una vista panor&aacute;mica del Lago Argentino y de las monta&ntilde;as circundantes y sus glaciares.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Actividades&nbsp;<span>de monta&ntilde;a como Tirolesa, Escalada, Rappel y Via Ferrata. Cruzando un ca&ntilde;ad&oacute;n a 30 metros de altura en un marco de estepa patagonica, escalando y haciendo rappel como via ferrata en paredes de roca sedimentaria de entre 9 y 27 metros de altura.&nbsp;</span></span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Tirolesa</strong></span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">En Enjoy! Podr&aacute;s experimentar la sensaci&oacute;n de volar en nuestras dos tirolesas de 160 metros de largo y 30 metros de alto, cruzando el Ca&ntilde;adon del Arroyo Calafate y con una vista sensacional del Lago Argentino.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Rappel</strong></span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Es la t&eacute;cnica que se utiliza para descender paredes verticales. En Enjoy! Tenemos rapeles de diferentes dificultades, de entre 9 y 27 metros de altura! Donde podr&aacute;s poner a prueba tu coraje y sentir la adrenalina de un descenso vertical.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Escalada</strong></span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">La escalada se desarrolla en paredes de roca natural, a la orilla del Arroyo Calafate en un marco natural espectacular. Contamos con escaladas de diferente dificultad de forma tal que todos lleguen a su propia cumbre!</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Via Ferrata </strong>Se trata de un estilo de escalada asistida, donde a trav&eacute;s de escaleras colgantes y otros dispositivos de seguridad iras progresando en la pared hasta llegar a la parte mas alta del ca&ntilde;ad&oacute;n, desde donde podr&aacute;s apreciar el paisaje con una vista inigualable desde el medio de la pared de roca.</span><strong>&nbsp;</strong><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">&nbsp;</span><br>', 'si', 'no', 5, 1405351606, '440.00', 1),
(29, 1, 5, 'Cerro Frías 4x4 sin alzo', '', '<span style="font-size: small;"><strong>Salida:</strong>&nbsp;09:00 hs.&nbsp;<strong>Regreso:</strong>&nbsp;13:00 hs.<br /><strong>Salida: </strong>12:00 hs. <strong>Regreso:</strong> 15:30 hs.<br /><strong>Salida:</strong> 15:30 hs. <strong>Regreso:</strong> 19:00 hs.&nbsp;</span><br>\r\n<span style="font-size: small;">La Traves&iacute;a 4X4 consiste en un ascenso que comienza por el faldeo este del Cerro Fr&iacute;as ubicado a 23 km de EL Calafate, dentro de la Estancia Alice, &nbsp;con vista al cuerpo principal del Lago Argentino, alcanzando un primer mirador natural a los 450 mts. de altura. Contin&uacute;a el recorrido, con vista a la Boca del Diablo y la Pen&iacute;nsula de Avellaneda, hasta alcanzar los 1030 mts. Desde la cima, la vista alcanza el Cerro Fitz Roy (200 km al norte) y el Macizo de Paine (Chile).</span><br>\r\n<span style="font-size: small;">La vista panor&aacute;mica desde Cerro Fr&iacute;as ofrece una interesante introducci&oacute;n a la regi&oacute;n geogr&aacute;fica y sus encantos, pudiendo divisar desde la cima los principales cerros de la cordillera, los l&iacute;mites del Parque Nacional y los hitos hist&oacute;ricos de los diferentes exploradores.&nbsp;El descenso se realiza por el faldeo sur, con vista al Valle del Centinela, hasta la base donde se encuentra el Quincho de Campo. Durante el recorrido, es posible el avisaje de animales silvestres como guanacos, zorros, c&oacute;ndores y liebres.</span><br>\r\n<span style="font-size: small;">Limitaciones: Esta actividad no tiene limitaciones, puede ser realizada por personas de todas las edades en diferentes condiciones de estado f&iacute;sico.&nbsp;</span><br>\r\n<span style="font-size: small;">Se recomienda llevar suficiente abrigo, lentes, sombrero y protectores solares.</span><br>', 'si', 'no', 5, 1405352640, '520.00', 1),
(56, 1, 5, 'Cerro Frias Trekking o Tirolesa C/Alzo', '', '<p style="text-align: justify;"><span style="font-size: small;"><strong>Salida:</strong> 09:00 hs. <strong>Regreso:</strong> 14:00 hs.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Incluye almuerzo.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>TIROLESA:</strong></span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"> La actividad de tirolesa consiste en desplazarse a lo largo de diferentes v&iacute;as de cable con un sistema de poleas. Las tirolesas est&aacute;n ubicadas en el faldeo sur del Cerro Fr&iacute;as y cruzan en zigzag por encima de un ca&ntilde;ad&oacute;n. Luego de proveer el equipo de monta&ntilde;a necesario para realizar la actividad (arneses, cascos y mosquetones), el circuito comienza ascendiendo en veh&iacute;culo de tracci&oacute;n integral hasta los 540 mts. de altura, donde se encuentra la primera plataforma. Desde all&iacute;, se inicia el descenso a trav&eacute;s de 5 l&iacute;neas de aproximadamente 500 mts de largo cada una, colgadas a una altura m&aacute;xima de 100 mts.</span><span style="font-size: small;"> Con sus 2500 mts. de largo, la tirolesa de Cerro Fr&iacute;as es la m&aacute;s larga de Sudam&eacute;rica.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong> Limitaciones:</strong> Actividad que puede ser realizada por personas a partir de los 6 a&ntilde;os de edad, en buenas condiciones f&iacute;sicas. Peso M&aacute;ximo: 110 KG. </span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>EXCLUYENTE</strong>: para mujeres embarazadas, personas que padezcan enfermedades con riesgo de deterioro funcional u org&aacute;nico durante la marcha, personas con discapacidad motriz y problemas cardiacos. Este recorrido no es recomendado para personas con problemas de equilibrio, asma, incapacidades, problemas de la columna, cuello u hombros. CERRO FRIAS se reserva el derecho de admisi&oacute;n por razones de seguridad. Si alguna persona no sigue las instrucciones de seguridad que el personal le indica puede ser retirado del recorrido.</span><span style="font-size: small;"><strong> </strong></span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Recomendaciones:</strong> Ropa c&oacute;moda, abrigada y a adecuada a la actividad, calzados de trekking.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>TRKKING:</strong></span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Desde el Quincho de Cerro Fr&iacute;as se inician diferentes senderos que se adaptan a las necesidades y aptitudes de diferentes personas. Caminando sobre el faldeo sur de la monta&ntilde;a se alcanzan puntos panor&aacute;micos que permiten vistas del Valle del Centinela, Lago Argentino, Brazo Rico del Lago Argentino y Torres del Paine. El paisaje combina estepa y bosque de &aacute;rboles de lenga que albergan diferentes tipos de plantas y animales dispuestos para ser descubiertos por el ojo agudo de los aventureros.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong> Limitaciones:</strong> Actividad que puede ser realizada por personas a partir de los 6 a&ntilde;os de edad, en buenas condiciones f&iacute;sicas. </span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>EXCLUYENTE</strong> para personas que padezcan enfermedades con riesgo de deterioro funcional u org&aacute;nico durante la marcha, personas con discapacidad motriz y problemas cardiacos. Este recorrido no es recomendado para personas con problemas de equilibrio, asma, incapacidades, problemas de la columna, cuello u hombros. </span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>CERRO FRIAS </strong>se reserva el derecho de admisi&oacute;n por razones de seguridad. </span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Recomendaciones:</strong> Ropa c&oacute;moda, abrigada y a adecuada a la actividad, calzado de trekking.</span><br>', 'si', 'no', 5, 1420237610, '710.00', 1),
(57, 1, 5, 'Cerro Frias Trekking o Tirolesa sin alzo', '', '<span style="font-size: small;"><strong>Salida:</strong>&nbsp;09:00 hs.&nbsp;<strong>Regreso:</strong>&nbsp;13:00 hs.<br /><strong>Salida:</strong> 12:00 hs. <strong>Regreso:</strong> 15:00 hs.<br /><strong>Salida:</strong> 15:30 hs. <strong>Regreso:</strong> 19:00 hs.</span><br>\r\n&nbsp;<br>\r\n<strong style="font-size: small;">TIROLESA:</strong><br>\r\n<span style="font-size: small;">La actividad de tirolesa consiste en desplazarse a lo largo de diferentes v&iacute;as de cable con un sistema de poleas. Las tirolesas est&aacute;n ubicadas en el faldeo sur del Cerro Fr&iacute;as y cruzan en zigzag por encima de un ca&ntilde;ad&oacute;n. Luego de proveer el equipo de monta&ntilde;a necesario para realizar la actividad (arneses, cascos y mosquetones), el circuito comienza ascendiendo en veh&iacute;culo de tracci&oacute;n integral hasta los 540 mts. de altura, donde se encuentra la primera plataforma. Desde all&iacute;, se inicia el descenso a trav&eacute;s de 5 l&iacute;neas de aproximadamente 500 mts de largo cada una, colgadas a una altura m&aacute;xima de 100 mts.&nbsp;Con sus 2500 mts. de largo, la tirolesa de Cerro Fr&iacute;as es la m&aacute;s larga de Sudam&eacute;rica.</span> <span style="font-size: small;"><strong>Limitaciones:</strong>&nbsp;Actividad que puede ser realizada por personas a partir de los 6 a&ntilde;os de edad, en buenas condiciones f&iacute;sicas. Peso M&aacute;ximo: 110 KG.&nbsp;<br /></span><span style="font-size: small;"><strong>EXCLUYENTE</strong>: para mujeres embarazadas, personas que padezcan enfermedades con riesgo de deterioro funcional u org&aacute;nico durante la marcha, personas con discapacidad motriz y problemas cardiacos. Este recorrido no es recomendado para personas con problemas de equilibrio, asma, incapacidades, problemas de la columna, cuello u hombros. CERRO FRIAS se reserva el derecho de admisi&oacute;n por razones de seguridad. Si alguna persona no sigue las instrucciones de seguridad que el personal le indica puede ser retirado del recorrido.<strong>&nbsp;</strong></span> <br /><span style="font-size: small;"><strong>Recomendaciones:</strong>&nbsp;Ropa c&oacute;moda, abrigada y a adecuada a la actividad, calzados de trekking.</span><br>\r\n<span style="font-size: small;">&nbsp;</span> <span style="font-size: small;"><strong>TRKKING:</strong></span><br>\r\n<span style="font-size: small;">Desde el Quincho de Cerro Fr&iacute;as se inician diferentes senderos que se adaptan a las necesidades y aptitudes de diferentes personas. Caminando sobre el faldeo sur de la monta&ntilde;a se alcanzan puntos panor&aacute;micos que permiten vistas del Valle del Centinela, Lago Argentino, Brazo Rico del Lago Argentino y Torres del Paine. El paisaje combina estepa y bosque de &aacute;rboles de lenga que albergan diferentes tipos de plantas y animales dispuestos para ser descubiertos por el ojo agudo de los aventureros.</span> <br /><span style="font-size: small;"><strong>Limitaciones:</strong>&nbsp;Actividad que puede ser realizada por personas a partir de los 6 a&ntilde;os de edad, en buenas condiciones f&iacute;sicas.&nbsp;</span> <br /><span style="font-size: small;"><strong>EXCLUYENTE</strong>&nbsp;para personas que padezcan enfermedades con riesgo de deterioro funcional u org&aacute;nico durante la marcha, personas con discapacidad motriz y problemas cardiacos. Este recorrido no es recomendado para personas con problemas de equilibrio, asma, incapacidades, problemas de la columna, cuello u hombros.&nbsp;</span><br>\r\n<span style="font-size: small;"><strong>CERRO FRIAS&nbsp;</strong>se reserva el derecho de admisi&oacute;n por razones de seguridad.&nbsp;</span> <span style="font-size: small;"><strong>Recomendaciones:</strong>&nbsp;Ropa c&oacute;moda, abrigada y a adecuada a la actividad, calzado de trekking.</span><br>', 'si', 'no', 6, 1420237894, '520.00', 1),
(58, 1, 5, 'Cerro Frias Cabalgata C/alzo', '', '<span style="font-size: small;"><strong>Salida:</strong> 09:00 hs. <strong>Regreso:</strong> 14:00 hs.</span><br>\r\n<span style="font-size: small;">Inlcuye almuerzo.</span><br>\r\n<p style="text-align: justify;"><span class="Text_Caja" style="font-size: small;">Cerro Fr&iacute;as ofrece una cabalgata de monta&ntilde;a al paso, apta para principiantes, que revela la belleza y calma de los alrededores.&nbsp;<br />La caballeriza est&aacute; ubicada a pocos metros del Quincho y, desde all&iacute;, comienza el paseo que se realiza en forma circular alcanzando los 600 mts. de altura. El faldeo sur de Cerro Fr&iacute;as constituye un entorno admirable, con vista al Valle del Centinela y al Brazo Rico del Lago Argentino. A medida que se asciende a caballo, la altura revela im&aacute;genes del cuerpo principal del Lago Argentino, El Calafate y las Torres del Paine. A lo largo del circuito es posible cruzarse con animales silvestres y de estancia que animan el recorrido hasta volver, nuevamente, a los corrales. </span><br>\r\n<p style="text-align: justify;"><span class="Text_Caja" style="font-size: small;">Limitaciones: </span><br>\r\n<p style="text-align: justify;"><span class="Text_Caja" style="font-size: small;">Recomendaciones: El programa de la actividad se encuentra sujeto a modificaciones de acuerdo a las condiciones clim&aacute;ticas.</span><br>\r\n<p style="text-align: justify;"><span class="Text_Caja" style="font-size: small;"><span>CERRO FRIAS se reserva el derecho de admisi&oacute;n por razones de seguridad. Si alguna persona no sigue las instrucciones de seguridad que el personal le indica puede ser retirado del recorrido.</span><br /></span><br>', 'si', 'no', 5, 1420238817, '710.00', 1),
(59, 1, 5, 'Cerro Frias Cabalgata sin alzo', '', '<span style="font-size: small;"><strong>Salida:</strong>&nbsp;09:00 hs.&nbsp;<strong>Regreso:</strong>&nbsp;13:00 hs.<br /><strong>Salida:</strong> 12:00 hs. <strong>Regreso: </strong>15:30 hs.</span><br /><span style="font-size: small;"><strong>Salida:</strong> 15:30 hs. <strong>Regreso:</strong> 19:00 hs.</span><br /><br /><br>\r\n<span class="Text_Caja" style="font-size: small;">Cerro Fr&iacute;as ofrece una cabalgata de monta&ntilde;a al paso, apta para principiantes, que revela la belleza y calma de los alrededores.&nbsp;<br />La caballeriza est&aacute; ubicada a pocos metros del Quincho y, desde all&iacute;, comienza el paseo que se realiza en forma circular alcanzando los 600 mts. de altura. El faldeo sur de Cerro Fr&iacute;as constituye un entorno admirable, con vista al Valle del Centinela y al Brazo Rico del Lago Argentino. A medida que se asciende a caballo, la altura revela im&aacute;genes del cuerpo principal del Lago Argentino, El Calafate y las Torres del Paine. A lo largo del circuito es posible cruzarse con animales silvestres y de estancia que animan el recorrido hasta volver, nuevamente, a los corrales.&nbsp;</span><br>\r\n<span class="Text_Caja" style="font-size: small;">Limitaciones:&nbsp;</span><br>\r\n<span class="Text_Caja" style="font-size: small;">Recomendaciones: El programa de la actividad se encuentra sujeto a modificaciones de acuerdo a las condiciones clim&aacute;ticas.</span><br>\r\n<span class="Text_Caja" style="font-size: small;">CERRO FRIAS se reserva el derecho de admisi&oacute;n por razones de seguridad. Si alguna persona no sigue las instrucciones de seguridad que el personal le indica puede ser retirado del recorrido.<br /></span><br>', 'si', 'no', 6, 1420239599, '520.00', 1),
(60, 1, 5, 'Cuevas del Walichu', '', '<span style="font-size: small;"><strong>Salida:&nbsp;</strong>09:00 hs.<strong>&nbsp;Regreso:&nbsp;</strong>11:00 hs.<strong><br /></strong><strong>Salida:&nbsp;</strong>15:00 hs.<strong>&nbsp;Regreso:&nbsp;</strong>17:00 hs.&nbsp;</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Un paseo que lleva a lugares cercanos y lejanos en el tiempo. El recorrido se realiza en un bus con sistema de video y un gu&iacute;a que transmitir&aacute; la historia de los primeros pobladores de Calafate, y observaci&oacute;n de lugares de inter&eacute;s. Visita a las Cuevas del Walichu. Hacia el este de Calafate, sobre la costa del Lago Argentino se encuentran paredes y cuevas donde los hombres primitivos de la zona dejaron testimonio de su paso por el lugar. Se pueden ver manos en negativo, escenas de caza, figuras humanas y otras representaciones. El entorno con la vista de la playa y las cuevas es magn&iacute;fico.&nbsp;</span><br>\r\n<span style="font-size: small;">Incluye ingreso a Punta Walichu.</span><br>', 'si', 'no', 6, 1420239882, '200.00', 1),
(61, 1, 5, 'Cabalgata El Chabon corta', '', '', 'si', 'no', 5, 1420240163, '350.00', 1),
(62, 1, 5, 'Cabalgata El Chabon larga', '', '', 'si', 'no', 5, 1420240572, '600.00', 1),
(63, 1, 5, 'Cabalgata La Hoya corta', '', '', 'si', 'no', 5, 1420240696, '450.00', 1),
(64, 1, 5, 'Cabalgata La Hoya larga', '', '', 'si', 'no', 5, 1420240785, '900.00', 1),
(65, 1, 5, 'Exc. 4x4 Balcon de El Calafate', '', '', 'si', 'no', 5, 1420241366, '500.00', 1),
(66, 1, 5, 'Exc. Cuatriciclos Quad Escape', '', '', 'si', 'no', 5, 1420241488, '500.00', 1),
(67, 1, 5, 'Exc. Mountain Bike Cross Fire', '', '<p style="text-align: justify;"><span style="font-size: small;"><strong>Duraci&oacute;n:</strong> 3 hs.</span><br /><strong><span style="font-size: small;">Salida: &nbsp;</span></strong><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Bike Park</strong>&nbsp;para grupos y toda la familia con una vista extraordinaria.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Programa dise&ntilde;ado para grupos,&nbsp;<strong>familias</strong>. </span><br /><span style="font-size: small;">El recorrido de 13 km de descenso nos lleva por los lugares perdidos como Laguna Escondida. El terreno es suave y amplio con pendientes que nos llevan en descensos constantes. En el camino podemos ver algunas grandes vistas del El Calafate, Lago Argentino y Cerro Fitz Roy. Es tambi&eacute;n el trayecto m&aacute;s largo en el&nbsp;<strong>Calafate Mountain Park</strong>.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Lugar donde la aventura, adrenalina y las mejores vistas panor&aacute;micas se hace presente en un mismo lugar. Ubicado en el&nbsp;<strong>Cerro Huyliche a 1050 m</strong>. sobre el nivel del mar, ofrece la posibilidad de realizar diferentes circuitos y bajadas en Mountain Bike.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">El circuito Cross Fire, pensado para grupos, familias y viajes de incentivo, nos lleva por lugares perdidos como Laguna Escondida. El terreno es suave y amplio con pendientes que nos llevan en descensos constantes.</span><br>\r\n&nbsp;<br>\r\n&nbsp;<br>', 'si', 'no', 5, 1420242142, '500.00', 1),
(71, 1, 5, 'Chalten Viedma Light - Criollos', '', '<p style="text-align: justify;"><span style="font-size: small;"><span lang="EN-US">Full day Chalten. <br /></span>Visita al Chorrillo del Salto + Navegaci&oacute;n en el Lago Viedma.<br />Incluye almuerzo de dos tiempos.&nbsp;</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Salida:</strong>&nbsp;07:00 hs.&nbsp;<strong>Regreso:</strong>&nbsp;19:30 hs.&nbsp;</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Partiendo desde el hotel donde se encuentra alojando acompa&ntilde;ados por un gu&iacute;a biling&uuml;e, se toma la ruta N&deg; 11 hasta la intersecci&oacute;n de la ruta nacional N&deg; 40 (32 Km) en direcci&oacute;n a El Chalten, se realizara una parada en un mirador frente a la cabecera del Lago Argentino, para observar la Cordillera de los Andes y la inmensidad del Lago Argentino, continuando el recorrido la pr&oacute;xima parada se realiza en el hist&oacute;rico y centenario parador " La Leona" ubicado sobre la margen del R&iacute;o La Leona (que conecta los lagos Viedma y Argentino) un lugar ideal para entrarse en la historia de la patagonia, se continua el recorrido hasta el encuentro de la ruta provincial N&deg; 23&nbsp;&nbsp;para dirigirnos a la localidad del El Chalt&eacute;n (90 km), antes de llegar podremos observar desde el mirador Glaciar Viedma la vista panor&aacute;mica los cerros Fitz Roy, Torre, Poincenot y el Glaciar Viedma (el m&aacute;s grande del Parque Nacional Los Glaciares).&nbsp;Llegada a El Chalten, visita a la peque&ntilde;a Villa Tur&iacute;stica enclavada al pie del Monte Fitz Roy o tambi&eacute;n llamado Chalten donde se podr&aacute; tomar im&aacute;genes del macizo, la experiencia continua por la ruta N&deg; 41 recorriendo 2 km de ripio bordeando el r&iacute;o de Las Vueltas, para visitar &ldquo;El Chorrillo del Salto&rdquo;, donde se realiza una caminata de 20 minutos (senda peatonal) &nbsp;en principio sobre monte para luego llegar al monte bajo y encontrar los primeros &ntilde;ires, al finalizar el sendero podremos apreciar este salto de agua (aguas de deshielo) de 20 metros de altura, para quien guste podr&aacute; acceder a esta altura para lograr inmejorables im&aacute;genes. &nbsp;</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Luego de esta visita regresamos al pueblo para tomar el almuerzo que se brinda (plato principal y postre). </span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Continuamos la excursi&oacute;n hacia Bah&iacute;a Tunel donde se embarca a las 14:45 para navegar en las aguas del Lago Viedma y apreciar la majestuosidad del Glaciar Viedma - el m&aacute;s grande en extensi&oacute;n del Parque Nacional Los Glaciares -, regreso al muelle 17:45 hs para tomar el transporte de regreso a El Calafate, llegada 19:30 hs. .</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Para disfrutar de la excursi&oacute;n, les recomendamos prestar atenci&oacute;n a los siguientes puntos:&nbsp;<br /> <br /> CLIMA: En Patagonia Sur el clima puede cambiar radicalmente varias veces al d&iacute;a. En verano, la temperatura media ronda los 18&ordm; (cuando hay m&aacute;s de 17 horas diarias de luz), y no llega a 2&ordm; en invierno, con una luminosidad de 8 horas diarias. <br />Llevar la indumentaria adecuada es fundamental.<br /> ROPA: Es necesario tener ropa de abrigo e impermeable a mano. Recomendamos llevar ropa que permita vestirse en &ldquo;capas&rdquo;. Traer guantes, gorro, campera impermeable, calzado c&oacute;modo y abrigado, bufanda o cuello. Para quienes realizan actividades de trekking, son fundamentales unas buenas botas de trekking que protejan los tobillos, dado que caminar&aacute;n por terreno rocoso.<br /> <br /> SOL: para disfrutar del trekking de manera completa tener anteojos solares, de modo de proteger la vista. Adem&aacute;s, para la piel, es importante una buena crema protectora con filtro solar.&nbsp;</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><br /> <!--[if !supportLineBreakNewLine]--><br /> <!--[endif]--></span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Rese&ntilde;a Glaciar Viedma</strong></span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"> El Glaciar Viedma, ubicado dentro del Parque Nacional Los Glaciares, en la Provincia de Santa Cruz, es el m&aacute;s grande de la Argentina. Antiguamente se cre&iacute;a que era el Upsala, pero los &uacute;ltimos estudios indican que el Viedma cuenta con una mayor superficie (978 km2). Este glaciar fluye directamente del Hielo Patag&oacute;nico Sur hasta el Lago Viedma, su frente se eleva aproximadamente 40 metros sobre el nivel del lago. Sus nacientes se encuentran en el coraz&oacute;n del Campo de Hielo entre los 1.500 y 2.200 msnm. Tiene unas l&iacute;neas oscuras en su superficie, que son bandas de ceniza volc&aacute;nica, mezcladas con el hielo. Es un glaciar que ha sufrido retrocesos aunque no tan importantes como otros glaciares. El Lago Viedma fue descubierto por Antonio de Viedma. Se toma conocimiento exacto de su ubicaci&oacute;n y caracter&iacute;sticas, como consecuencia de la expedici&oacute;n que realizaron, hacia el a&ntilde;o 1877, Francisco Pascacio Moreno y Carlos Mar&iacute;a Moyano. Perteneciente a la cuenca h&iacute;drica del r&iacute;o Santa Cruz, el Lago est&aacute; enclavado entre los 49&ordm; y 50&ordm; de latitud Sur. Nace en la cordillera de los Andes, aunque su l&oacute;bulo oriental se apoya en comarcas sub andinas. La costa occidental del lago es alta, erosionada por la acci&oacute;n de los hielos; en cambio la costa oriental (por la que transita la ruta provincial N&ordm;23) presenta un aspecto bajo. Un brazo en forma de fiordo se extiende al pie del cerro Campana. De contornos &aacute;ridos, entrecortados por bell&iacute;simas monta&ntilde;as cubiertas de nieve y una extensi&oacute;n de 85 km. de largo y 20 km. de ancho, la cuenca no cuenta con afluentes de importancia, por lo que su mayor aporte lo recibe del gigantesco glaciar. Su lengua se desprende del hielo patag&oacute;nico, al oeste del cord&oacute;n Mariano Moreno, por el valle de factura&nbsp;</span><br>', 'si', 'no', 20, 1421076656, '1400.00', 1),
(43, 1, 5, 'Chalten Viedma Light - Viva', '', '<p style="text-align: justify;"><span style="font-size: small;">Full day Chalten. Alzo en Chalten. Visita al Chorrillo del Salto. Navegaci&oacute;n en el Lago Viedma.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Salida:</strong> 07:00 hs. <strong>Regreso:</strong> 20:00 hs.</span>&nbsp;<br>\r\n<p style="text-align: justify;"><span style="font-size: small;">El Glaciar Viedma, ubicado dentro del Parque Nacional Los Glaciares, en la Provincia de SantaCruz, es el m&aacute;s grande de la Argentina. Antiguamente se cre&iacute;a que era el Upsala, pero los&uacute;ltimos estudios indican que el Viedma cuenta con una mayor superficie (978 km2). Este glaciarfluye directamente del Hielo Patag&oacute;nico Sur hasta el Lago Viedma, su frente se elevaaproximadamente 40 metros sobre el nivel del lago. Sus nacientes se encuentran en el coraz&oacute;ndel Campo de Hielo entre los 1.500 y 2.200 msnm.Tiene unas l&iacute;neas oscuras en su superficie, que son bandas de ceniza volc&aacute;nica, mezcladas conel hielo. Es un glaciar que ha sufrido retrocesos aunque no tan importantes como otros glaciares.El Lago Viedma fue descubierto por Antonio de Viedma. Se toma conocimiento exacto de suubicaci&oacute;n y caracter&iacute;sticas, como consecuencia de la expedici&oacute;n que realizaron, hacia el a&ntilde;o1877, Francisco Pascacio Moreno y Carlos Mar&iacute;a Moyano. Perteneciente a la cuenca h&iacute;drica delr&iacute;o Santa Cruz, el Lago est&aacute; enclavado entre los 49&ordm; y 50&ordm; de latitud Sur. Nace en la cordillera delos Andes, aunque su l&oacute;bulo oriental se apoya en comarcas sub andinas. La costa occidental dellago es alta, erosionada por la acci&oacute;n de los hielos; en cambio la costa oriental (por la quetransita la ruta provincial N&ordm;23) presenta un aspecto bajo. Un brazo en forma de fiordo seextiende al pie del cerro Campana.De contornos &aacute;ridos, entrecortados por bell&iacute;simas monta&ntilde;as cubiertas de nieve y una extensi&oacute;nde 85 km. de largo y 20 km. de ancho, la cuenca no cuenta con afluentes de importancia, por loque su mayor aporte lo recibe del gigantesco glaciar. Su lengua se desprende del hielopatag&oacute;nico, al oeste del cord&oacute;n Mariano Moreno, por el valle de factura glaciar que se ubicaentre los cerros Huemul (2.677 m) y Campana (2.570 m).</span><br>\r\n<p style="text-align: justify;"><strong><span style="font-size: small;">Itinerario:</span></strong> <span style="font-size: small;"> </span><span style="font-size: small;">07.00 hs: Pick up por hotel en El Calafate.</span><span style="font-size: small;">8.00 hs: Salida con rumbo a El Chalt&eacute;n. 12:00 hs: Almuerzo Eco Camp. 13:45 hs: Salida desde Eco Camp hacia el puerto de Bah&iacute;a T&uacute;nel. 14:45 hs: Embarque y navegaci&oacute;n por el Lago Viedma. 17:45 hs: Salida de Bah&iacute;a T&uacute;nel hacia El Calafate 20:00 hs: Arribo a El Calafate&nbsp;</span><br>', 'si', 'no', 5, 1420215943, '1400.00', 1),
(44, 1, 5, 'Chalten Viedma Ice Trek - Viva', '', '<strong><span style="font-size: small;">Full day Chalten. Trekking sobre el Glaciar Viedma.<br />Incluye vianda.&nbsp;</span></strong><br>\r\n<span style="font-size: small;"><strong>Salida:</strong> 07:00 hs. <strong>Regreso:</strong> 20:00 hs.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">El Glaciar Viedma, ubicado dentro del Parque Nacional Los Glaciares, en la Provincia de Santa Cruz, es el m&aacute;s grande de la Argentina. Antiguamente se cre&iacute;a que era el Upsala, pero lo s&uacute;ltimos estudios indican que el Viedma cuenta con una mayor superficie (978 km2). Este glaciar fluye directamente del Hielo Patag&oacute;nico Sur hasta el Lago Viedma, su frente se eleva aproximadamente 40 metros sobre el nivel del lago. Sus nacientes se encuentran en el coraz&oacute;ndel Campo de Hielo entre los 1.500 y 2.200 msnm. Tiene unas l&iacute;neas oscuras en su superficie, que son bandas de ceniza volc&aacute;nica, mezcladas conel hielo. Es un glaciar que ha sufrido retrocesos aunque no tan importantes como otros glaciares. El Lago Viedma fue descubierto por Antonio de Viedma. Se toma conocimiento exacto de suubicaci&oacute;n y caracter&iacute;sticas, como consecuencia de la expedici&oacute;n que realizaron, hacia el a&ntilde;o 1877, Francisco Pascacio Moreno y Carlos Mar&iacute;a Moyano. Perteneciente a la cuenca h&iacute;drica delr&iacute;o Santa Cruz, el Lago est&aacute; enclavado entre los 49&ordm; y 50&ordm; de latitud Sur. Nace en la cordillera delos Andes, aunque su l&oacute;bulo oriental se apoya en comarcas sub andinas. La costa occidental dellago es alta, erosionada por la acci&oacute;n de los hielos; en cambio la costa oriental (por la quetransita la ruta provincial N&ordm;23) presenta un aspecto bajo. Un brazo en forma de fiordo seextiende al pie del cerro Campana. De contornos &aacute;ridos, entrecortados por bell&iacute;simas monta&ntilde;as cubiertas de nieve y una extensi&oacute;nde 85 km. de largo y 20 km. de ancho, la cuenca no cuenta con afluentes de importancia, por loque su mayor aporte lo recibe del gigantesco glaciar. Su lengua se desprende del hielopatag&oacute;nico, al oeste del cord&oacute;n Mariano Moreno, por el valle de factura glaciar que se ubicaentre los cerros Huemul (2.677 m) y Campana (2.570 m).</span><br>\r\n<strong><span style="font-size: small;">Itinerario:</span></strong><br>\r\n<span style="font-size: small;">07.00 hs: Pick up por hotel en El Calafate. </span><br /><span style="font-size: small;">08.00 hs: Salida con rumbo a El Chalt&eacute;n. </span><br /><span style="font-size: small;">11:30 hs: Llegada y embarque en Puerto de Bah&iacute;a T&uacute;nel. </span><br /><span style="font-size: small;">17:45 hs: Arribo a Bah&iacute;a T&uacute;nel. </span><br /><span style="font-size: small;">20:00 hs: Arribo a El Calafate.&nbsp;</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Durante la navegaci&oacute;n rumbo al Glaciar Viedma se podr&aacute;n observar los macizos del Cerro Fitz Roy y Cerro Huemul. Al llegar al Cabo de Hornos (extremo sureste del Campo Ventisqueros), la embarcaci&oacute;n vira al oeste y se encuentra con la vista imponente del Glaciar. Se realiza el desembarque en el promontorio rocoso frente al Glaciar Viedma, donde los gu&iacute;asde trekking se encargan de la seguridad y de trekking, tambi&eacute;n compartir&aacute;n sus conocimientos acerca del &aacute;rea, con una breve charla de Glaciolog&iacute;a. Desde all&iacute; se realiza una breve caminata por el terreno, que pocos a&ntilde;os atr&aacute;s fue ocupado por el glaciar. Al cabo de algunos minutos se llega al borde del Glaciar, donde todos los visitantes secalzan los grampones necesarios para subir al Glaciar. Finalmente, comienza un trekking de dos&nbsp;horas y media sobre el Glaciar Viedma. Durante el transcurso del trekking se pueden encontrarsumideros, grietas y cuevas. Durante la excursi&oacute;n se har&aacute; un break para almorzar.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Incluye:&bull; Gu&iacute;a de monta&ntilde;a habilitado por la APN&bull; Traslados regular desde / hacia El Calafate, saliendo de la Oficina de Patagonia Aventura.&bull; Grampones.&bull; Snack a bordo.No incluye:&bull; Equipo personal (Indumentaria de abrigo, guantes, lentes de sol, calzado, etc)&bull; Lunch box.&bull; Todo servicio no especificado.&bull; Entrada al Parque Nacional Los Glaciares. </span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Importante: Edad m&iacute;nima: 12 a&ntilde;os (acompa&ntilde;ados por sus padres o tutores)<br /></span><span style="font-size: small;">Edad m&aacute;xima: Sin l&iacute;mite&nbsp; </span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">CLIMA &amp; SUGERENCIAS.Para su estad&iacute;a en El Chalten, les recomendamos prestar atenci&oacute;n a los siguientes puntos:</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">CLIMA: En Patagonia Sur el clima puede cambiar radicalmente varias veces al d&iacute;a. En verano, la temperatura media ronda los 18&ordm; (cuando hay m&aacute;s de 17 horas diarias de luz), y no llega a 2&ordm; en invierno, con una luminosidad de 8 horas diarias. Traer la indumentaria adecuada esfundamental. ROPA: Es necesario tener ropa de abrigo e impermeable a mano. Recomendamos traer ropaque permita vestirse en &ldquo;capas&rdquo;. Traer guantes, gorro, campera impermeable, calzado c&oacute;modo yabrigado, bufanda o cuello. Para quienes realizan actividades de trekking, son fundamentales unas buenas botas de trekking que protejan los tobillos, dado que caminar&aacute;n por terreno rocoso. SOL: El trekking sobre el Glaciar Viedma es un espect&aacute;culo &uacute;nico. Es importante para disfrutarlode manera completa tener anteojos solares, de modo de proteger la vista del intenso reflejo delglaciar y el lago. Adem&aacute;s, para la piel, es importante una buena crema protectora con filtro solar.</span><br>', 'si', 'no', 5, 1420216295, '1750.00', 1),
(31, 1, 5, 'Tk Minitrekking', '', '<p style="text-align: justify;"><span style="font-size: small;"><strong>Horario de salida:</strong> seg&uacute;n reserva<br /><strong>Duraci&oacute;n:</strong> 8 horas &nbsp;</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Desde El Calafate al Glaciar perito Moreno se recorren de 80 km, por camino asfaltado, 50 km hasta el ingresando al Portal del Parque Nacional Los Glaciares (donde se abona la entrada al Parque).</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">El minitrekking se inicia en el Puerto ubicado en la Bah&iacute;a "Bajo de las Sombras", - situado &nbsp;7 km antes de las pasarelas del Glaciar Glaciar Perito Moreno, donde se embarca para cruzar el Brazo Rico del Lago Argentino, llegando a la costa sudoeste luego de aproximadamente 20 minutos de Navegaci&oacute;n con vista de la pared sur del Glaciar Perito Moreno. &nbsp;Luego del desembarco se accede al refugio donde los Gu&iacute;as organizan los grupos (de 20 personas) &nbsp;inici&aacute;ndose entonces una caminata por la orilla del Lago de aproximadamente 20 minutos hasta el Glaciar, al llegar al borde del hielo los Gu&iacute;as colocan los grampones a los excursionistas, quienes reciben instrucciones sobre la forma en que deben desplazarse sobre el hielo.   El recorrido sobre el Glaciar se prolonga durante una hora y cincuenta minutos. Durante el transcurso del mismo se podr&aacute; apreciar una variedad de formaciones de hielo como: grietas, seracs, sumideros, peque&ntilde;as lagunas, etc. La caminata es moderada. La superficie del hielo sobre la que se camina es irregular, pero firme y segura. Se recibir&aacute;n explicaciones acerca de la Flora, fauna y Glaciolog&iacute;a general de la regi&oacute;n como as&iacute; tambi&eacute;n del fen&oacute;meno particular de ruptura del Glaciar; al final el paseo se regresa al refugio. Tiempo para el almuerzo. Con posterioridad cruce del brazo Rico para regresar al muelle&nbsp;</span><span style="font-size: small;">donde un autob&uacute;s los espera para trasladarlos hasta el Mirador del Glaciar y sus pasarelas, donde podr&aacute;n permanecer durante una hora. Luego se emprender&aacute; el regreso hacia El Calafate. </span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Algunas recomendaciones para tener en cuenta: - usar botas de trekking o zapatillas - llevar guantes y anteojos de sol - llevar vianda para el almuerzo (el refugio no cuenta con instalaciones gastron&oacute;micas ni proveedur&iacute;a).</span><br>\r\n<p style="text-align: justify;"><strong><span style="font-size: small;">NOTA: DE ACUERDO AL HORARIO DE SALIDA DESDE EL CALAFATE Y REALIZACI&Oacute;N DEL TREKKING SOBRE EL GLACIAR, EL ITINERARIO PUEDE VARIAR, PUDIENDO VISITAR PRIMERO LAS PASARELAS.</span></strong><br>', 'si', 'no', 5, 1405436044, '1020.00', 1),
(32, 1, 5, 'Tk Big Ice', '', '<p style="text-align: justify;"><span style="font-size: small;">Se trata de una expedici&oacute;n al centro del Glaciar Perito Moreno, una imperdible experiencia, reservada s&oacute;lo para aventureros con buen estado f&iacute;sico.  El recorrido se realiza enteramente sobre formaciones glaciarias, grietas y cavernas de hielo.  La excursi&oacute;n comienza en El Calafate, temprano por la ma&ntilde;ana, cuando se inicia el traslado hasta el Puerto &ldquo;Bajo de las Sombras&rdquo;. All&iacute;, aproximadamente a las 9 AM, se toma la embarcaci&oacute;n &ldquo;Tehuelche&rdquo; para cruzar el Brazo Rico, y desembarcar 10 minutos despu&eacute;s en la costa oeste. Los gu&iacute;as de monta&ntilde;a lo conducir&aacute;n a&uacute;n m&aacute;s cerca del glaciar donde deber&aacute; tomar los grampones que usar&aacute; luego sobre el hielo. En este punto se inicia la traves&iacute;a de aproximaci&oacute;n.  Este sendero transcurre por la morena sur del glaciar Perito Moreno. En poco m&aacute;s de una hora llegar&aacute; hasta un espectacular mirador, por donde acceder&aacute; al hielo.   Una vez en el glaciar y ya con los grampones puestos, el mundo toma una nueva perspectiva: Lagunas azules, profundas grietas, enormes sumideros, m&aacute;gicas cuevas, y la sensaci&oacute;n &uacute;nica de sentirse en el centro del glaciar.   Siempre acompa&ntilde;ados e instruidos por gu&iacute;as expertos, transcurrir&aacute;n tres horas de exploraci&oacute;n de todos los rincones del glaciar m&aacute;s especial del mundo. Durante el recorrido los gu&iacute;as le brindar&aacute;n todos los conocimientos acerca del hielo y su entorno.  Al mediod&iacute;a todo el grupo compartir&aacute; media hora de pic nic sobre el manto blanco.   Poco despu&eacute;s comienza el regreso, para lo cual habr&aacute; que caminar nuevamente sobre la morena, aproximadamente una hora, hasta tomar la embarcaci&oacute;n. Ser&aacute; un retorno silencioso y emocionado, el trekking sobre el hielo es uno de los m&aacute;s espectaculares del mundo.  El horario de embarque para el regreso es aproximadamente a las 3 PM.  Luego de arribar nuevamente al puerto se puede continuar la excursi&oacute;n hacia las pasarelas frente al Glaciar.  La excursi&oacute;n es de d&iacute;a completo. </span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong> Nota imporante:</strong> Debido a la exigencia f&iacute;sica y la dificultad del terreno, esta excursi&oacute;n es apta s&oacute;lo para <strong>personas entre 18 y 45 a&ntilde;os de edad</strong> y que posean un estado f&iacute;sico aceptable, considerando que se caminar&aacute; alrededor de 7 horas sobre hielo y terreno con piedras. </span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;"><strong>Recomendaciones:</strong> Es muy importante llevar anteojos para sol y protector solar de alta graduaci&oacute;n. Del mismo modo, se recomiendo usar ropa c&oacute;moda y abrigada, gorro, guantes y, en lo posible, campera impermeable. En cuanto al calzado, lo ideal son las botas tipo trekking, pero en caso de no tenerlas, elegir un calzado con buena suela y no de lona.   Tambi&eacute;n es importante llevar una mochila peque&ntilde;a para la c&aacute;mara y todas las peque&ntilde;as cosas que siempre hacen falta. As&iacute; tendr&aacute; las manos libres para ayudarse todas las veces que lo necesite.</span><br>', 'si', 'no', 5, 1405436666, '1600.00', 1),
(41, 1, 1, 'Glaciar Sur Aventura', '', '<p style="text-align: justify;"><span style="font-size: small;"><strong>Salida:</strong> 08:00 R<strong>egreso:</strong> 19:00</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Admite pasajeros de 14 a 60 a&ntilde;os. <br />Los pax tienen que completar ficha medica. <br />Tienen que llevar mochila para la vianda.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">El lago roca es parte de una ruta que une el paisaje y la historia; las estancias y el glaciar Moreno.&nbsp;</span><br /><span style="font-size: small;">La expedici&oacute;n m&aacute;s pr&oacute;xima de El Calafate, en el conf&iacute;n austral del Parque Nacional Los Glaciares. Es un l&iacute;nea de observaci&oacute;n del tiempo glaciariointensa, para grupos reducidos, con atenci&oacute;npersonal, m&aacute;s atractivos y tiempos ajustados.</span><br>\r\n<p class="font_8" style="text-align: justify;"><span class="color_16" style="font-size: small;">Es una excursi&oacute;n dirigida a viajeros que disfrutan caminar en lugares rec&oacute;nditos. Verdaderamente quienes han realizado este trekking sienten que son los primeros en llegar a los lugares que visitan.</span><br>\r\n<p class="font_8" style="text-align: justify;">&nbsp;<br>\r\n<p class="font_8" style="text-align: justify;"><span style="font-size: small;">El recorrido</span><br>\r\n<p class="font_8" style="text-align: justify;"><span class="color_16" style="font-size: small;">Comienza en Calafate a las 08.00 &nbsp;hs, se recorren 50 kms hasta el Lago Roca, embarcamos en una semirr&iacute;gido cabinado con capacidad para 17 personas. Luego de navegar por espacio de 45 minutos arribamos a la cabecera sur del Brazo Sur, lugar en donde comienza la primera etapa de la caminata para arribar al Lago Fr&iacute;as, sitio en donde se embarca en gomones con capacidad para 7 pax con los que navegamos hacia el extremo oeste de dicho lago y &nbsp;en donde luego de desembarcar se realiza la segunda caminata hacia el Glaciar Frias / Dickson extremo SO del Parque Nacional. All&iacute; en medio de un paisaje incre&iacute;ble se almuerza el lunch box incluido para luego iniciar el retorno.</span><br>\r\n<p class="font_8" style="text-align: justify;"><span style="font-size: small;">El regreso</span><br>\r\n<p class="font_8" style="text-align: justify;"><span class="color_16" style="font-size: small;">Se arriba al hotel aproximadamente a las 19 hs.</span><br>\r\n<p class="font_8" style="text-align: justify;"><span class="color_16" style="font-size: small;">Se camina entre ida y vuelta alrededor de 14 kms en 6 hs. No se paga el ingreso al Parque Nacional. Los pasajeros est&aacute;n siempre acompa&ntilde;ados desde Calafate por un Gu&iacute;a de trekking biling&uuml;e (ingl&eacute;s/espa&ntilde;ol, eventualmente italiano) adem&aacute;s de la tripulaci&oacute;n.</span><br>\r\n<p class="font_8" style="text-align: justify;"><span class="color_16" style="font-size: small;">Recomendaciones<br />Dadas las caracteristicas del clima, es necesario llevar campera impermeable, guantas, botas de trekking, mochilla para llevar la vianda de comida y pertenencias personales. &nbsp;</span><br>', 'si', 'no', 5, 1420214128, '2250.00', 1),
(38, 1, 5, 'Exc. SIB Glaciar. P. Moreno', '', '<strong><span style="font-size: small;">Exc. Regular Glaciar Perito Moreno.</span></strong><span style="font-size: small;"><strong>No incluye entrada al PN.</strong><strong>Opcional: Safari Nautico.</strong><strong>Salida:</strong> 09:00 hs. - <strong>Regreso:</strong> 16:30&nbsp; </span><br>\r\n&nbsp;\r\n<p style="text-align: justify;"><span style="font-size: small;">Salida desde su alojamiento acompa&ntilde;ados durante todo el trayecto por un guia bilingue del Parque Nacional Los Glaciares, se recorren 80 Km hasta el &aacute;rea de pasarelas frente al Glaciar Perito Moreno. Comenzando el recorrido, hacia la derecha del camino se puede apreciar el Lago Argentino y su Bah&iacute;a Redonda . En los primeros 40 Km. domina el paisaje la estepa patag&oacute;nica, para luego ingresar dentro del Parque Nacional Los Glaciares, donde predomina la vegetaci&oacute;n arb&oacute;rea, en su mayor&iacute;a perteneciente a la familia de los Nothofagus (Lengas, &Ntilde;ires, Coihues de Magallanes).</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">En el portal del Parque Nacional Los Glaciares deber&aacute; abonarse la entrada al mismo, donde&nbsp;</span><span style="font-size: small;">el guia explicar&aacute; las reglas de comportamiento dentro del Parque Nacional. </span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Durante los 40 km restantes se realizar&aacute;n paradas para poder tomar fotos panor&aacute;micas y las primeras vistas de la pared sur del Glaciar Moreno. </span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Opcionalmente podr&aacute;n combinar esta excursi&oacute;n con la navegaci&oacute;n de una hora : Safari N&aacute;utico que bordea la pared sur del Glaciar.&nbsp;</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">El recorrido finaliza en las pasarelas donde el guia explicar&aacute; las opciones de pasarelas que podr&aacute;n recorrer. El recorrido por las pasarelas es libre hasta el horario de encuentro que fijar&aacute; el gu&iacute;a. </span><br>\r\n<p style="text-align: justify;">&nbsp;<br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Las pasarelas tienen una extensi&oacute;n de 5 km y est&aacute;n constituidas por escalinatas que descienden hasta aproximarse a unos 300 mtrs del frente del glaciar. A 146 mtrs del acceso a las mismas se ecuentra el Balc&oacute;n Principal, desde donde se aprecia una impactante vista de las paredes norte y sur ademas de la zona de endicamiento del glaciar. Desde cada uno de los balcones restantes distribuidos a lo largo de las escalinatas, puede apreciarse la majestuosidad de este gigante de hielo.&nbsp;</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Para el almuerzo el &aacute;rea cuenta con un restaurante y un snack bar. </span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Luego del recorrido por pasarelas comienza el regreso a El Calafate.&nbsp;</span><br>', 'si', 'no', 20, 1419103859, '500.00', 1),
(69, 1, 5, 'Exc. Minitrekking Grupo Criollos', '', '<p style="text-align: justify;"><span><strong>Horario de salida:</strong>&nbsp;seg&uacute;n grupo.</span><strong>Incluye gu&iacute;a en trasaldos y pasarelas.&nbsp;Duraci&oacute;n:</strong>&nbsp;8 horas.&nbsp;<strong>No inlcuye entrada al Parque Nacional.&nbsp;</strong><br>\r\n<p style="text-align: justify;"><span>Desde El Calafate al Glaciar perito Moreno se recorren de 80 km, por camino asfaltado, 50 km hasta el ingresando al Portal del Parque Nacional Los Glaciares (donde se abona la entrada al Parque).</span> <span>El minitrekking se inicia en el Puerto ubicado en la Bah&iacute;a "Bajo de las Sombras", - situado &nbsp;7 km antes de las pasarelas del Glaciar Glaciar Perito Moreno, donde se embarca para cruzar el Brazo Rico del Lago Argentino, llegando a la costa sudoeste luego de aproximadamente 20 minutos de Navegaci&oacute;n con vista de la pared sur del Glaciar Perito Moreno. &nbsp;Luego del desembarco se accede al refugio donde los Gu&iacute;as organizan los grupos (de 20 personas) &nbsp;inici&aacute;ndose entonces una caminata por la orilla del Lago de aproximadamente 20 minutos hasta el Glaciar, al llegar al borde del hielo los Gu&iacute;as colocan los grampones a los excursionistas, quienes reciben instrucciones sobre la forma en que deben desplazarse sobre el hielo. El recorrido sobre el Glaciar se prolonga durante una hora y cincuenta minutos. Durante el transcurso del mismo se podr&aacute; apreciar una variedad de formaciones de hielo como: grietas, seracs, sumideros, peque&ntilde;as lagunas, etc. La caminata es moderada. La superficie del hielo sobre la que se camina es irregular, pero firme y segura. Se recibir&aacute;n explicaciones acerca de la Flora, fauna y Glaciolog&iacute;a general de la regi&oacute;n como as&iacute; tambi&eacute;n del fen&oacute;meno particular de ruptura del Glaciar; al final el paseo se regresa al refugio. Tiempo para el almuerzo. Con posterioridad cruce del brazo Rico para regresar al muelle&nbsp;</span><span>donde un autob&uacute;s los espera para trasladarlos hasta el Mirador del Glaciar y sus pasarelas, donde podr&aacute;n permanecer durante una hora. Luego se emprender&aacute; el regreso hacia El Calafate.</span><br>\r\n<p style="text-align: justify;"><span>Algunas recomendaciones para tener en cuenta: - usar botas de trekking o zapatillas - llevar guantes y anteojos de sol - llevar vianda para el almuerzo (el refugio no cuenta con instalaciones gastron&oacute;micas ni proveedur&iacute;a).</span><br>\r\n<p style="text-align: justify;"><strong><span>NOTA: DE ACUERDO AL HORARIO DE SALIDA DESDE EL CALAFATE Y REALIZACI&Oacute;N DEL TREKKING SOBRE EL GLACIAR, EL ITINERARIO PUEDE VARIAR, PUDIENDO VISITAR PRIMERO LAS PASARELAS.</span></strong><br>', 'si', 'no', 18, 1420847584, '1400.00', 1),
(70, 1, 5, 'Discovery Chalten - Criollos', '', '<p style="text-align: justify;"><span style="font-size: small;">Full Day Chalten.</span><span style="font-size: small;"> <br />Incluye vianda con bebida.</span><span style="font-size: small;"> <br /><strong>Salida:</strong><strong>&nbsp;</strong>07:00 hs.&nbsp;<strong>Regreso:</strong>&nbsp;19:30 hs.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Partiendo desde el hotel donde se encuentra alojado acompa&ntilde;ados por un gu&iacute;a biling&uuml;e, se toma la ruta N&deg; 11 hasta la intersecci&oacute;n de la ruta nacional N&deg; 40 (32 Km) en direcci&oacute;n a El Chalten, se realizara una parada en un mirador frente a la cabecera del Lago Argentino, para observar la Cordillera de los Andes y la inmensidad del Lago Argentino, continuando el recorrido la pr&oacute;xima parada se realiza en el hist&oacute;rico y centenario parador " La Leona" ubicado sobre la margen del R&iacute;o La Leona (que conecta los lagos Viedma y Argentino) un lugar ideal para entrarse en la historia de la patagonia, se continua el recorrido hasta el encuentro de la ruta provincial N&deg; 23&nbsp;&nbsp;para dirigirnos a la localidad del El Chalt&eacute;n (90 km), antes de llegar podremos observar desde el mirador Glaciar Viedma la vista panor&aacute;mica los cerros Fitz Roy, Torre, Poincenot y el Glaciar Viedma (el m&aacute;s grande del Parque Nacional Los Glaciares).&nbsp;Visita a la peque&ntilde;a Villa Tur&iacute;stica enclavada al pie del Monte Fitz Roy o tambi&eacute;n llamado Chalten donde se podr&aacute; tomar im&aacute;genes del macizo , la experiencia continua por la ruta N&deg; 41 recorriendo 37 km de ripio bordeando el r&iacute;o de Las Vueltas, este trayecto del paseo nos ofrece maravillosas vista del bosque andino patag&oacute;nico, peque&ntilde;as cascadas y lagunas, la ruta finaliza en el Lago del Desierto, donde se embarca en la punta sur &nbsp;para realizar la navegaci&oacute;n de 20 minutos sobre el bell&iacute;simo lago rodeado de monta&ntilde;as e imponente vegetaci&oacute;n , desembarque en la Bah&iacute;a Vespignani, se realiza una caminata de 500 metros entr&aacute;ndose en el bosque donde se encuentra un domo que se utiliza de base, ac&aacute; el grupo puede optar por dos actividades: realizar un trekking por el bosque virgen de lengas y &ntilde;ires y costa del lago disfrutando de su pic nic, o realizar un trekking de medio hora hasta el punto panor&aacute;mico donde se aprecia el imponente Glaciar Vespignani, regreso al muelle para tomar la embarcaci&oacute;n y emprender el regreso hacia el Calafate, previa parada en el Chalten.</span><br>\r\n<p style="text-align: justify;">&nbsp;<br>\r\n<p style="text-align: justify;"><span style="font-size: small;">CLIMA - SUGERENCIAS.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Para disfrutar de la excursi&oacute;n, les recomendamos prestar atenci&oacute;n a los siguientes puntos:&nbsp;</span><span style="font-size: small;"> <br />CLIMA: En Patagonia Sur el clima puede cambiar radicalmente varias veces al d&iacute;a. En verano, la temperatura media ronda los 18&ordm; (cuando hay m&aacute;s de 17 horas diarias de luz), y no llega a 2&ordm; en invierno, con una luminosidad de 8 horas diarias. Traer la indumentaria adecuada es fundamental.</span><span style="font-size: small;"> ROPA: Es necesario tener ropa de abrigo e impermeable a mano. Recomendamos traer ropa que permita vestirse en &ldquo;capas&rdquo;. Traer guantes, gorro, campera impermeable, calzado c&oacute;modo y abrigado, bufanda o cuello. Para quienes realizan actividades de trekking, son fundamentales unas buenas <strong>botas de trekking</strong> que protejan los tobillos, dado que caminar&aacute;n por terreno rocoso.</span> <br /><span style="font-size: small;"> SOL: para disfrutar del trekking de manera completa tener anteojos solares, de modo de proteger la vista . Adem&aacute;s, para la piel, es importante una buena crema protectora con filtro solar.&nbsp;</span><br>\r\n<p style="text-align: justify;">&nbsp;<br>', 'si', 'no', 40, 1420921371, '1500.00', 1),
(72, 1, 1, 'Chalten Viedma Ice Trek - Criollos', '', '<span style="font-size: small;"><strong>Full day Chalten. Trekking sobre el Glaciar Viedma.<br /> Incluye vianda.&nbsp;</strong>&nbsp;</span><br /><span style="font-size: small;"> <strong>Salida:</strong>&nbsp;07:00 hs.&nbsp;<strong>Regreso: </strong>19:30 hs.</span><br>\r\n<span style="font-size: small;">Edad m&iacute;nima: 12 a&ntilde;os (acompa&ntilde;ados por sus padres o tutores)</span><br /><span style="font-size: small;"> Edad m&aacute;xima: Sin l&iacute;mite&nbsp;</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">Partiendo desde el hotel donde se encuentra alojando acompa&ntilde;ados por un gu&iacute;a biling&uuml;e, se toma la ruta N&deg; 11 hasta la intersecci&oacute;n de la ruta nacional N&deg; 40 (32 Km) en direcci&oacute;n a El Chalten, se realiza una parada en el hist&oacute;rico y centenario parador " La Leona" ubicado sobre la margen del R&iacute;o La Leona (que conecta los lagos Viedma y Argentino) un lugar ideal para entrarse en la historia de la patagonia, se continua el recorrido hasta el encuentro de la ruta provincial N&deg; 23&nbsp;&nbsp;para dirigirnos a Bah&iacute;a T&uacute;nel, antes de llegar podremos observar desde el mirador Glaciar Viedma la vista panor&aacute;mica los cerros Fitz Roy, Torre, Poincenot y el Glaciar Viedma (el m&aacute;s grande del Parque Nacional Los Glaciares). </span><br /><span style="font-size: small;"> 11:30 hs. Llegada y embarque, durante la navegaci&oacute;n rumbo al Glaciar Viedma se podr&aacute;n observar los macizos del Cerro Fitz Roy y Cerro Huemul. Al llegar al Cabo de Hornos (extremo sureste del Campo Ventisqueros), la embarcaci&oacute;n vira al oeste y se encuentra con la vista imponente del Glaciar. Se realiza el desembarque en el promontorio rocoso frente al Glaciar Viedma, donde los gu&iacute;as de trekking se encargan de la seguridad y de trekking, tambi&eacute;n compartir&aacute;n sus conocimientos acerca del &aacute;rea, con una breve charla de Glaciolog&iacute;a. Desde all&iacute; se realiza una breve caminata por el terreno, que pocos a&ntilde;os atr&aacute;s fue ocupado por el glaciar. Al cabo de algunos minutos se llega al borde del Glaciar, donde todos los visitantes se calzan los grampones necesarios para subir al Glaciar. Finalmente, comienza un trekking de dos&nbsp;horas y media sobre el Glaciar Viedma. Durante el transcurso del trekking se pueden encontrar sumideros, grietas y cuevas. Durante la excursi&oacute;n se har&aacute; un break para almorzar. 17:45 arribo a Bah&iacute;a Tunel para tomar el veh&iacute;culo con regreso a El Calafate. De regreso se realiza una parada en La Leona.</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">CLIMA &amp; SUGERENCIAS.</span><br>\r\n<span style="font-size: small;">Para disfrutar del paseo, les recomendamos prestar atenci&oacute;n a los siguientes puntos:</span><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">CLIMA: En Patagonia Sur el clima puede cambiar radicalmente varias veces al d&iacute;a. En verano, la temperatura media ronda los 18&ordm; (cuando hay m&aacute;s de 17 horas diarias de luz), y no llega a 2&ordm; en invierno, con una luminosidad de 8 horas diarias. Traer la indumentaria adecuada es fundamental. ROPA: Es necesario tener ropa de abrigo e impermeable a mano. Recomendamos traer ropa que permita vestirse en &ldquo;capas&rdquo;. Traer guantes, gorro, campera impermeable, calzado c&oacute;modo y abrigado, bufanda o cuello. Para quienes realizan actividades de trekking, son fundamentales unas buenas botas de trekking que protejan los tobillos, dado que caminar&aacute;n por terreno rocoso. SOL: El trekking sobre el Glaciar Viedma es un espect&aacute;culo &uacute;nico. Es importante para disfrutarlo de manera completa tener anteojos solares, de modo de proteger la vista del intenso reflejo del glaciar y el lago. Adem&aacute;s, para la piel, es importante una buena crema protectora con filtro solar.</span><br>\r\n<p style="text-align: justify;"><strong><span style="font-size: small;">Rese&ntilde;a Glaciar Viedma</span></strong><br>\r\n<p style="text-align: justify;"><span style="font-size: small;">El Glaciar Viedma, ubicado dentro del Parque Nacional Los Glaciares, en la Provincia de Santa Cruz, es el m&aacute;s grande de la Argentina. Antiguamente se cre&iacute;a que era el Upsala, pero los &uacute;ltimos estudios indican que el Viedma cuenta con una mayor superficie (978 km2). Este glaciar fluye directamente del Hielo Patag&oacute;nico Sur hasta el Lago Viedma, su frente se eleva aproximadamente 40 metros sobre el nivel del lago. Sus nacientes se encuentran en el coraz&oacute;n del Campo de Hielo entre los 1.500 y 2.200 msnm. Tiene unas l&iacute;neas oscuras en su superficie, que son bandas de ceniza volc&aacute;nica, mezcladas con el hielo. Es un glaciar que ha sufrido retrocesos aunque no tan importantes como otros glaciares. El Lago Viedma fue descubierto por Antonio de Viedma. Se toma conocimiento exacto de su ubicaci&oacute;n y caracter&iacute;sticas, como consecuencia de la expedici&oacute;n que realizaron, hacia el a&ntilde;o 1877, Francisco Pascacio Moreno y Carlos Mar&iacute;a Moyano. Perteneciente a la cuenca h&iacute;drica del r&iacute;o Santa Cruz, el Lago est&aacute; enclavado entre los 49&ordm; y 50&ordm; de latitud Sur. Nace en la cordillera de los Andes, aunque su l&oacute;bulo oriental se apoya en comarcas sub andinas. La costa occidental del lago es alta, erosionada por la acci&oacute;n de los hielos; en cambio la costa oriental (por la que transita la ruta provincial N&ordm;23) presenta un aspecto bajo. Un brazo en forma de fiordo se extiende al pie del cerro Campana. De contornos &aacute;ridos, entrecortados por bell&iacute;simas monta&ntilde;as cubiertas de nieve y una extensi&oacute;n de 85 km. de largo y 20 km. de ancho, la cuenca no cuenta con afluentes de importancia, por lo que su mayor aporte lo recibe del gigantesco glaciar. Su lengua se desprende del hielo patag&oacute;nico, al oeste del cord&oacute;n Mariano Moreno, por el valle de factura glaciar que se ubica entre los cerros Huemul (2.677 m) y Campana (2.570 m).</span><br>', 'si', 'no', 20, 1421098249, '1750.00', 1);
